"37834":{"id":"37834","name":"Encontro Explosivo","slug":"encontro-explosivo","original_title":"Knight and Day","overview":"Roy Miller (Tom Cruise) é um agente que guarda consigo uma bateria especial, que jamais descarrega. O objeto é cobiçado pelo governo dos Estados Unidos, que enviou o agente Fitzgerald (Peter Sarsgaard) para obtê-lo, e Antonio (Jordi Mollà), um perigoso bandido espanhol. No aeroporto Miller usa June Havens (Cameron Diaz) para passar a bateria pela alfândega. June deseja apenas chegar o quanto antes para participar do casamento de sua irmã e, devido à pressa, consegue transferir seu voo para o mesmo de Miller. Só que no voo estão vários agentes destacados para eliminar Miller e recuperar a bateria, a qualquer custo.","first_air_date":"2010-06-15","runtime":109,"episode_run_time":[109],"vote_average":6.2,"created_by":["Pink Machine","Tree Line Films","Dune Entertainment","Regency Enterprises","20th Century Fox"],"production_companies":[{"name":"Pink Machine"},{"name":"Tree Line Films"},{"name":"Dune Entertainment"},{"name":"Regency Enterprises"},{"name":"20th Century Fox"}],"cast":["Tom Cruise","Cameron Diaz","Peter Sarsgaard","Viola Davis","Jordi Mollà"],"backdrop_path":"https://image.tmdb.org/t/p/original/k5mNW8qutywD3GhAuaq33qcQR2y.jpg","poster_path":"https://image.tmdb.org/t/p/original/ovgL7y93qKZpOWLlmYsZPf8HzYM.jpg","certification":"14","genres":["Ação","Comédia"],"trailer":"N/A"},
"10771":{"id":"10771","name":"O Terno de 2 Bilhões de Dólares","slug":"o-terno-de-2-bilhoes-de-dolares","original_title":"The Tuxedo","overview":"Jimmy Tong é o simpático chofer do milionário Clark Devlin, que acaba sofrendo um acidente que o hospitaliza. Tong é enviado para a casa de seu patrão para resolver alguns assuntos quando, sem saber, decide experimentar seu terno. Tal ato não haveria nenhum problema se o terno de Devlin não fosse computadorizado e desse a quem o veste uma série de poderes, fazendo com que Tong se envolva em uma intriga internacional de espionagem que o coloca ao lado de Del Blaine, sua mais nova parceira.","first_air_date":"2002-09-27","runtime":98,"episode_run_time":[98],"vote_average":5.7,"created_by":["DreamWorks Pictures","Vanguard Films","Parkes/MacDonald Productions","Paramount Pictures"],"production_companies":[{"name":"DreamWorks Pictures"},{"name":"Vanguard Films"},{"name":"Parkes/MacDonald Productions"},{"name":"Paramount Pictures"}],"cast":["Jackie Chan","Jennifer Love Hewitt","Jason Isaacs","Debi Mazar","Ritchie Coster"],"backdrop_path":"https://image.tmdb.org/t/p/original/1wo90L3F7hA9h6cG5xfz3dB1IE6.jpg","poster_path":"https://image.tmdb.org/t/p/original/zcadZ67yI62RedbT86iEcS6cxYU.jpg","certification":"12","genres":["Thriller","Ação","Comédia","Ficção científica"],"trailer":"N/A"},
"4133":{"id":"4133","name":"Profissão de Risco","slug":"profissao-de-risco","original_title":"Blow","overview":"Em plenos anos 70, o tráfico de drogas cresce e se espalha cada vez mais rumo aos quatro cantos do planeta. Nos Estados Unidos o elo principal é George Jung, que logo se torna o principal importador de cocaína do Cartel de Medelin, comandado por Pablo Escobar. Durante duas décadas, Jung foi um dos principais alvos do combate às drogas do governo americano e era quem fazia a conexão entre os EUA e a Colômbia.","first_air_date":"2001-04-04","runtime":124,"episode_run_time":[124],"vote_average":7.4,"created_by":["New Line Cinema","Spanky Pictures","Apostle"],"production_companies":[{"name":"New Line Cinema"},{"name":"Spanky Pictures"},{"name":"Apostle"}],"cast":["Johnny Depp","Penélope Cruz","Franka Potente","Rachel Griffiths","Ray Liotta"],"backdrop_path":"https://image.tmdb.org/t/p/original/v3ClsT59peXyGJ4XuDvIQAPwcZy.jpg","poster_path":"https://image.tmdb.org/t/p/original/fnh5mrR97ULnlFGe5Itb1qz12e9.jpg","certification":"16","genres":["Crime","Drama"],"trailer":"N/A"},
"1700":{"id":"1700","name":"Louca Obsessão","slug":"louca-obsessao","original_title":"Misery","overview":"Depois de terminar seu mais novo manuscrito, o escritor de sucesso, Paul Sheldon, decide sair para comemorar. O problema é que está nevando demais e Paul acaba sofrendo um terrível acidente. Ele é salvo e abrigado por uma ex-enfermeira chamada Annie Wilkes, que se auto-intitula sua fã número um. Aparentemente uma simpática e doce senhora, Annie, aos poucos, vai se revelando uma sádica psicótica, que começa a torturar Paul quando descobre que ele matou sua personagem favorita em seu último livro publicado. Agora, Paul Sheldon terá de usar suas artimanhas de escritor para ganhar tempo, enganar Annie e, com sorte, escapar deste pesadelo.","first_air_date":"1990-11-30","runtime":107,"episode_run_time":[107],"vote_average":7.8,"created_by":["Castle Rock Entertainment","Nelson Entertainment","Columbia Pictures"],"production_companies":[{"name":"Castle Rock Entertainment"},{"name":"Nelson Entertainment"},{"name":"Columbia Pictures"}],"cast":["James Caan","Kathy Bates","Richard Farnsworth","Frances Sternhagen","Lauren Bacall"],"backdrop_path":"https://image.tmdb.org/t/p/original/rUAn3Ul1tL7JXMjZ951UOI3F0UA.jpg","poster_path":"https://image.tmdb.org/t/p/original/uOqA7w49sMfmXpkQXnDuDJRGFx4.jpg","certification":"14","genres":["Drama","Thriller"],"trailer":"VESCIlSfsVM"},
"8065":{"id":"8065","name":"Quebrando a Banca","slug":"quebrando-a-banca","original_title":"21","overview":"Ben Campbell, um aluno brilhante do Instituto Tecnológico de Massachusetts, precisa de dinheiro para pagar as mensalidades da faculdade. Ele entra para um grupo de estudantes liderado pelo professor Mickey Rosa, que usa seu conhecimento em matemática para ganhar nos cassinos em Las Vegas. Seduzido por sua bela colega e muito dinheiro, Ben descobre que os riscos são maiores do que imaginava quando cruza o caminho de Cole Williams.","first_air_date":"2008-03-27","runtime":123,"episode_run_time":[123],"vote_average":6.7,"created_by":["Columbia Pictures","Relativity Media","Michael De Luca Productions","Trigger Street Productions"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Relativity Media"},{"name":"Michael De Luca Productions"},{"name":"Trigger Street Productions"}],"cast":["Jim Sturgess","Kevin Spacey","Kate Bosworth","Aaron Yoo","Liza Lapira"],"backdrop_path":"https://image.tmdb.org/t/p/original/u6OCGwhSWhfQX1LZ4NTq0bfcWxs.jpg","poster_path":"https://image.tmdb.org/t/p/original/8h6De5GXn6z66chQsGcztR84AR5.jpg","certification":"12","genres":["Drama","Crime"],"trailer":"N/A"},
"2022":{"id":"2022","name":"A Herança de Mr. Deeds","slug":"a-heranca-de-mr-deeds","original_title":"Mr. Deeds","overview":"Deeds (Adam Sandler) vive na pequena cidade de Mandrake Falls, em New Hampshire, onde faz sucesso com sua pizzaria e leva uma vida tranquila. Até que, repentinamente, surgem dois executivos que lhe trazem uma notícia surpreendente: um tio afastado acabara de falecer e lhe deixou uma fortuna de US$ 40 bilhões, além do comando da maior empresa de comunicação do mundo e diversos outros negócios. Deeds parte então para a cidade grande, onde começa a implantar em seus novos negócios os valores de sua pequena cidade. É quando Babe Bennett (Winona Ryder), repórter de um tablóide sensacionalista, é enviada para observá-lo de perto, mas acaba se apaixonando por ele.","first_air_date":"2002-06-28","runtime":96,"episode_run_time":[96],"vote_average":5.9,"created_by":["Columbia Pictures","New Line Cinema","Happy Madison Productions","Out of the Blue... Entertainment"],"production_companies":[{"name":"Columbia Pictures"},{"name":"New Line Cinema"},{"name":"Happy Madison Productions"},{"name":"Out of the Blue... Entertainment"}],"cast":["Adam Sandler","Winona Ryder","John Turturro","Allen Covert","Peter Gallagher"],"backdrop_path":"https://image.tmdb.org/t/p/original/7P3VyWQTnZOYIQnk5seM0YQ9ucg.jpg","poster_path":"https://image.tmdb.org/t/p/original/9kv93ugqoB8SMCKkDgnt3zUSWlj.jpg","certification":"L","genres":["Comédia","Romance"],"trailer":"N/A"},
