"9276":{"id":"9276","name":"Prova Final","slug":"prova-final","original_title":"The Faculty","overview":"Repentinamente, em uma escola de uma pequena cidade no Ohio, os professores começam a agir estranhamente. Dois estudantes escondidos em um armário testemunham dois professores matando a enfermeira do colégio, mas logo a vítima aparece viva e eles logo concluem que algum alienígena está se apossando do corpos. Assim, o medo toma conta deles e de seus amigos, pois qualquer um pode ser dominado por este ser que ninguém sabe de onde veio, mas parece ter um objetivo definido: possuir todos os terrestres que surjam na sua frente.","first_air_date":"1998-12-25","runtime":104,"episode_run_time":[104],"vote_average":6.5,"created_by":["Los Hooligans Productions"],"production_companies":[{"name":"Los Hooligans Productions"}],"cast":["Josh Hartnett","Elijah Wood","Jordana Brewster","Clea DuVall","Shawn Hatosy"],"backdrop_path":"https://image.tmdb.org/t/p/original/oJRlYxfG10h4sxk2A7fpeOZnaFi.jpg","poster_path":"https://image.tmdb.org/t/p/original/leVEAb37sssYg8qLeo46Pc8IcH9.jpg","certification":"N/A","genres":["Terror","Ficção científica","Mistério"],"trailer":"N/A"},
"68737":{"id":"68737","name":"O Sétimo Filho","slug":"o-setimo-filho","original_title":"Seventh Son","overview":"Em uma época de encantamentos, quando lendas e magia se chocam, o único guerreiro que restou de uma ordem mística viaja para encontrar um profético herói, nascido com poderes incríveis, o Sétimo Filho. Retirado de sua vida calma como fazendeiro, o improvável jovem herói entra em uma desafiadora aventura, junto com seu mestre e mentor, para vencer uma poderosa feiticeira e seu exército de assassinos sobrenaturais que vão atacar seu reino.","first_air_date":"2014-12-12","runtime":102,"episode_run_time":[102],"vote_average":5.5,"created_by":["Legendary Pictures","Thunder Road","Moving Picture Company","Pendle Mountain Productions","China Film Group Corporation","Wigram Productions","Outlaw Sinema"],"production_companies":[{"name":"Legendary Pictures"},{"name":"Thunder Road"},{"name":"Moving Picture Company"},{"name":"Pendle Mountain Productions"},{"name":"China Film Group Corporation"},{"name":"Wigram Productions"},{"name":"Outlaw Sinema"}],"cast":["Jeff Bridges","Julianne Moore","Ben Barnes","Alicia Vikander","John DeSantis"],"backdrop_path":"https://image.tmdb.org/t/p/original/2EyK8wpLdYFaS35o0worjqsiuZn.jpg","poster_path":"https://image.tmdb.org/t/p/original/wO28QCMDZ55MiWJCBw4YABftiY2.jpg","certification":"12","genres":["Aventura","Fantasia"],"trailer":"hDZr3mUsieU"},
"872":{"id":"872","name":"Cantando na Chuva","slug":"cantando-na-chuva","original_title":"Singin' in the Rain","overview":"Em 1927, Hollywood, está um verdadeiro rebuliço com a transição do cinema mudo para o falado. Don Lockwood e Lina Lamont, o casal mais querido do cinema mudo, se prepara para rodar um musical. Mas, infelizmente, Lina não só não sabe cantar como tem uma voz horrível. A estreante, Kathy Selden, é chamada a emprestar sua voz à estrela. As gravações são uma confusão, mas tudo piora quando Don se apaixona pela doce Kathy. Ao lado de seu inseparável amigo, o compositor Cosmo Brown, ele tenta mostrar ao mundo o talento de Kathy.","first_air_date":"1952-04-09","runtime":102,"episode_run_time":[102],"vote_average":8.1,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Gene Kelly","Donald O'Connor","Debbie Reynolds","Jean Hagen","Millard Mitchell"],"backdrop_path":"https://image.tmdb.org/t/p/original/6qOyw4yfzbzTp5YsCX26C28Do0S.jpg","poster_path":"https://image.tmdb.org/t/p/original/vTGXImXK0tpCQojHFElA92mujYB.jpg","certification":"L","genres":["Comédia","Romance"],"trailer":"N/A"},
"1788":{"id":"1788","name":"Footloose: Ritmo Louco","slug":"footloose-ritmo-louco","original_title":"Footloose","overview":"Recém-chegado de Chicago, Ren McCormak fica frustrado quando descobre que a pequena cidade proíbe a dança e a música de rock. Enquanto se esforça para se ajustar, Ren enfrenta uma árdua batalha para mudar a situação. Com a ajuda de um amigo, Willard Hewitt e da adolescente rebelde Ariel Moore, ele talvez consiga liberar esta cidade conservadora. Mas o pai influente de Ariel, o reverendo Shaw Moore, se torna um obstáculo.","first_air_date":"1984-02-17","runtime":107,"episode_run_time":[107],"vote_average":6.7,"created_by":["Paramount Pictures","IndieProd Company Productions"],"production_companies":[{"name":"Paramount Pictures"},{"name":"IndieProd Company Productions"}],"cast":["Kevin Bacon","Lori Singer","John Lithgow","Dianne Wiest","Chris Penn"],"backdrop_path":"https://image.tmdb.org/t/p/original/t8n5mvmnJUYJkyfOPWYEtvqePuM.jpg","poster_path":"https://image.tmdb.org/t/p/original/p2MXCSI3nbzA1CqaDOSE2y8fvAE.jpg","certification":"12","genres":["Drama","Romance"],"trailer":"N/A"},
