"14442":{"id":"14442","name":"Uma Garota Encantada","slug":"uma-garota-encantada","original_title":"Ella Enchanted","overview":"Ella ganha o dom da obediência de sua madrinha. Após seu pai se casar novamente, sua vida piora ainda mais. Sua madrasta Olga e as filhas dela descobrem que Ella está sob o efeito do dom da obediência e passam a explorá-la cada vez mais. Decidida a mudar de vida, a garota sai de casa e inicia uma viagem para reencontrar sua madrinha, pois apenas ela pode desfazer o feitiço. No caminho, ela encontra o elfo Slannen, que decide acompanhar a viagem de Ella, e o Príncipe Char, por quem se apaixona.","first_air_date":"2004-04-09","runtime":96,"episode_run_time":[96],"vote_average":6.5,"created_by":["World 2000 Entertainment","Enchanted Productions"],"production_companies":[{"name":"World 2000 Entertainment"},{"name":"Enchanted Productions"}],"cast":["Anne Hathaway","Hugh Dancy","Cary Elwes","Aidan McArdle","Joanna Lumley"],"backdrop_path":"https://image.tmdb.org/t/p/original/uiECYOz9ZstouJXdHDKRQrp22lX.jpg","poster_path":"https://image.tmdb.org/t/p/original/z8erzsD2aMQwo6W309oM19g7qMF.jpg","certification":"L","genres":["Família","Fantasia","Comédia"],"trailer":"krU2jBFvxtE"},
