"676547":{"id":"676547","name":"A Luz do Demônio","slug":"a-luz-do-demonio","original_title":"Prey for the Devil","overview":"Irmã Ann é uma inquieta de 25 anos que acredita devotamente que realizar exorcismos é sua vocação. Mas ela está em desacordo com as tradições da instituição: freiras não podem realizar exorcismos, apenas padres. Com o apoio de um mentor, um professor que percebe seu dom especial, ela pode observar sessões de treinamento reais. Seu desejo de provar a si mesma toma um rumo pessoal quando ela conhece um dos pacientes mais perturbados da escola. Durante seus encontros angustiantes, a Irmã Ann fica cara a cara com uma força demoníaca que infesta a escola e tem laços misteriosos com seu próprio passado. É então que o poder do mal e suas próprias habilidades surpreendentes são plenamente realizadas.","first_air_date":"2022-10-23","runtime":93,"episode_run_time":[93],"vote_average":6.9,"created_by":["Lionsgate","Gold Circle Films","Confluence Productions"],"production_companies":[{"name":"Lionsgate"},{"name":"Gold Circle Films"},{"name":"Confluence Productions"}],"cast":["Jacqueline Byers","Colin Salmon","Christian Navarro","Lisa Palfrey","Nicholas Ralph"],"backdrop_path":"https://image.tmdb.org/t/p/original/mUa1u2GvwaivJtbJTSjxwl1OEVK.jpg","poster_path":"https://image.tmdb.org/t/p/original/mYa1vhjTYakyNCB65lR8Y7jujBn.jpg","certification":"14","genres":["Terror","Thriller"],"trailer":"0C_qLS1HcVU"},
"522162":{"id":"522162","name":"Midway: Batalha em Alto Mar","slug":"midway-batalha-em-alto-mar","original_title":"Midway","overview":"Narra os acontecimentos da Batalha de Midway, confronto entre as forças americanas e a Marinha Imperial Japonesa, que marcou um ponto de virada fundamental na Guerra do Pacífico, seis meses depois do ataque a Pearl Harbor. O filme se baseia em fatos históricos para contar a trajetória de líderes e soldados que usaram instinto e coragem para superar as adversidades e se manterem vivos durante a guerra no meio do maior oceano do planeta.","first_air_date":"2019-11-06","runtime":138,"episode_run_time":[138],"vote_average":7.1,"created_by":["AGC Studios","Centropolis Entertainment","Street Entertainment","Entertainment One","Starlight Culture Entertainment Group","Shanghai RuYi Entertainment"],"production_companies":[{"name":"AGC Studios"},{"name":"Centropolis Entertainment"},{"name":"Street Entertainment"},{"name":"Entertainment One"},{"name":"Starlight Culture Entertainment Group"},{"name":"Shanghai RuYi Entertainment"}],"cast":["Ed Skrein","Patrick Wilson","Woody Harrelson","Luke Evans","Mandy Moore"],"backdrop_path":"https://image.tmdb.org/t/p/original/5xegGPhCSVMKbyh6zeT6Th0BWLB.jpg","poster_path":"https://image.tmdb.org/t/p/original/f2x8lIh0olfwqe5Jbwsw4Ojc5ie.jpg","certification":"14","genres":["Ação","Guerra","História"],"trailer":"IivxfFJzFeQ"},
