"64635":{"id":"64635","name":"O Vingador do Futuro","slug":"o-vingador-do-futuro","original_title":"Total Recall","overview":"Doug Quaid (Colin Farrell) leva uma vida pacata. Ele mora na Colônia, trabalha em uma fábrica na Bretanha Unida e é casado com a bela Lori (Kate Beckinsale). Um dia, resolve visitar a Rekall, uma empresa que oferece aos clientes a inserção de memórias no cérebro, simulando viagens que não aconteceram de verdade. Doug se submete ao tratamento, mas durante a inserção algo dá errado e ele logo se vê cercado por policiais, os quais mata sem dó nem piedade. Sem saber o que está acontecendo, Doug foge para casa. Lá descobre que Lori também está contra ele e deseja matá-lo. Após escapar da esposa, Doug começa a decifrar o enigma: No passado ele foi um importante agente do chanceler Cohaagen (Bryan Cranston), com ligações entre os rebeldes que desejam a liberdade da Colônia.","first_air_date":"2012-08-02","runtime":118,"episode_run_time":[118],"vote_average":6.0,"created_by":["Total Recall","Original Film","Prime Focus","Rekall Productions","Columbia Pictures"],"production_companies":[{"name":"Total Recall"},{"name":"Original Film"},{"name":"Prime Focus"},{"name":"Rekall Productions"},{"name":"Columbia Pictures"}],"cast":["Colin Farrell","Jessica Biel","Kate Beckinsale","Ethan Hawke","Bill Nighy"],"backdrop_path":"https://image.tmdb.org/t/p/original/b83mjgS72dfZpUSsP4AtzM6TIZe.jpg","poster_path":"https://image.tmdb.org/t/p/original/q7SpzrOBAJPbGoqp6sOaowbTnsn.jpg","certification":"N/A","genres":["Ação","Ficção científica","Thriller"],"trailer":"N/A"},
