"449562":{"id":"449562","name":"As Trapaceiras","slug":"as-trapaceiras","original_title":"The Hustle","overview":"Beaumont-sur-mer, Riviera Francesa. Josephine (Anne Hathaway) e Penny (Rebel Wilson) são duas manipuladoras, conhecidas pela arte de extorquir milionários. No entanto, enquanto a primeira é sofisticada, a segunda tem métodos muito menos elegantes. De início Josephine aceita Penny como sua pupila, mas logo se percebe que na verdade a intenção era usá-la para um golpe específico e, logo em seguida, descartá-la. Surge então uma disputa entre elas, sobre quem conseguirá antes a quantia de US$ 500 mil de Thomas Westerburg (Alex Sharp), um prodígio da tecnologia, que está hospedado na cidade.","first_air_date":"2019-05-09","runtime":94,"episode_run_time":[94],"vote_average":6.2,"created_by":["Pin High","Metro-Goldwyn-Mayer","Cave 76 Productions","Camp Sugar","Palma Pictures"],"production_companies":[{"name":"Pin High"},{"name":"Metro-Goldwyn-Mayer"},{"name":"Cave 76 Productions"},{"name":"Camp Sugar"},{"name":"Palma Pictures"}],"cast":["Rebel Wilson","Anne Hathaway","Kumud Pant","Alex Sharp","Ingrid Oliver"],"backdrop_path":"https://image.tmdb.org/t/p/original/s6awXOxTKYQLSktiIJfI3969dZH.jpg","poster_path":"https://image.tmdb.org/t/p/original/e6AuIno1eZoDMQhFGKGAte6Syd7.jpg","certification":"12","genres":["Comédia","Crime"],"trailer":"pzOayCip1kM"},
