"508763":{"id":"508763","name":"A Caminho de Casa","slug":"a-caminho-de-casa","original_title":"A Dog's Way Home","overview":"Bella é uma cadelinha especial que vive com Lucas, um estudante de medicina veterinária que trabalha como voluntário em um hospital local. Um dia ela é encontrada pelo Controle de Animais na rua e acaba sendo levada para um abrigo a 400 milhas de distância de seu dono. No entanto, Bella, extremamente leal e corajosa, decide iniciar sozinha uma longa jornada de volta para a casa, emocionando todos que cruzam o seu caminho.","first_air_date":"2019-01-10","runtime":96,"episode_run_time":[96],"vote_average":7.4,"created_by":["Bona Film Group","Pariah","Columbia Pictures"],"production_companies":[{"name":"Bona Film Group"},{"name":"Pariah"},{"name":"Columbia Pictures"}],"cast":["Ashley Judd","Jonah Hauer-King","Edward James Olmos","Alexandra Shipp","Chris Bauer"],"backdrop_path":"https://image.tmdb.org/t/p/original/w7MsyOpP003FYhsiTgVHa3rNsrz.jpg","poster_path":"https://image.tmdb.org/t/p/original/hDBghjJCPeGXJTOMq4910KvR1l9.jpg","certification":"L","genres":["Drama","Aventura","Família"],"trailer":"SOpOFch8JaM"},
"301502":{"id":"301502","name":"Blonde","slug":"blonde","original_title":"Blonde","overview":"Cinebiografia de Marilyn Monroe, que contará sua vida a partir dos sete anos até sua morte. Após uma infância traumática, Norma Jeane Mortenson (Ana de Armas) tornou-se atriz na Hollywood dos anos 1950 e início dos anos 1960. Ela se transformou em uma figura mundialmente famosa sob o nome artístico de Marilyn Monroe. Todavia, por trás dos holofotes da fama, a atriz vivia guerras pessoais e suas aparições na tela contrastam fortemente com os problemas de amor, exploração, abuso de poder e dependência de drogas que ela enfrentava em sua vida privada. \"Blonde\" imagina corajosamente a vida de um dos símbolos mais duradouros de Hollywood, de sua infância volátil como Norma Jeane, até sua ascensão ao estrelato e envolvimentos românticos, o longa se apresenta como uma especulação da vida da sex symbol, atriz e modelo. Baseado no livro homônimo de Joyce Carol Oates.","first_air_date":"2022-09-16","runtime":166,"episode_run_time":[166],"vote_average":6.0,"created_by":["Plan B Entertainment"],"production_companies":[{"name":"Plan B Entertainment"}],"cast":["Ana de Armas","Adrien Brody","Bobby Cannavale","Sara Paxton","Lucy DeVito"],"backdrop_path":"https://image.tmdb.org/t/p/original/sdirxnHDdRmrM55mWfLCFeMdRSn.jpg","poster_path":"https://image.tmdb.org/t/p/original/9dmnwgKGkuxBgvDhOHaqlZtgrv9.jpg","certification":"18","genres":["Drama"],"trailer":"N/A"},
"428078":{"id":"428078","name":"Máquinas Mortais","slug":"maquinas-mortais","original_title":"Mortal Engines","overview":"Anos depois da \"Guerra dos Sessenta Minutos\", a Terra está destruída e para sobreviver as cidades se movem em rodas gigantes, conhecidas como Cidades Tração, e lutam com outras para conseguir mais recursos naturais. Quando Londres se envolve em um ataque, Tom é lançado para fora da cidade junto com uma fora-da-lei e os dois juntos precisam lutar para sobreviver e ainda enfrentar uma ameaça que coloca a vida no planeta em risco.","first_air_date":"2018-11-27","runtime":128,"episode_run_time":[128],"vote_average":6.2,"created_by":["Scholastic Productions","Silvertongue Films","Universal Pictures","WingNut Films","MRC"],"production_companies":[{"name":"Scholastic Productions"},{"name":"Silvertongue Films"},{"name":"Universal Pictures"},{"name":"WingNut Films"},{"name":"MRC"}],"cast":["Hera Hilmar","Robert Sheehan","Hugo Weaving","Jihae","Ronan Raftery"],"backdrop_path":"https://image.tmdb.org/t/p/original/rm2oMykm5nX6SzXFr7TGHkO6r8Z.jpg","poster_path":"https://image.tmdb.org/t/p/original/sBdtAsZNVPMOOYcq8zh0XULqU9T.jpg","certification":"14","genres":["Aventura","Ficção científica"],"trailer":"N/A"},
