"20766":{"id":"20766","name":"A Estrada","slug":"a-estrada","original_title":"The Road","overview":"O mundo foi destruído há mais de 10 anos, mas ninguém sabe o que exatamente aconteceu. Como resultado, não há energia, vegetação ou comida. Milhões de pessoas morreram, devido aos incêndios, inundações ou queimadas que se seguiram ao cataclisma. Neste contexto vivem um pai (Viggo Mortensen) e seu filho (Kodi Smit-McPhee), que sobrevivem de quaisquer alimento e vestuário que conseguem roubar. Apesar dos contratempos, eles seguem viagem pela estrada, sempre rumo ao oeste dos Estados Unidos.","first_air_date":"2009-11-25","runtime":111,"episode_run_time":[111],"vote_average":7.0,"created_by":["Dimension Films","2929 Productions","Nick Wechsler Productions","Chockstone Pictures"],"production_companies":[{"name":"Dimension Films"},{"name":"2929 Productions"},{"name":"Nick Wechsler Productions"},{"name":"Chockstone Pictures"}],"cast":["Viggo Mortensen","Kodi Smit-McPhee","Charlize Theron","Robert Duvall","Guy Pearce"],"backdrop_path":"https://image.tmdb.org/t/p/original/4b2t4F8Ho5H0wKvylvOA7F2KbVr.jpg","poster_path":"https://image.tmdb.org/t/p/original/6pm9nlQoGx8egjJx85NTgiOSLYG.jpg","certification":"16","genres":["Aventura","Drama"],"trailer":"N/A"},
"773736":{"id":"773736","name":"TINA","slug":"tina","original_title":"TINA","overview":"Desde o início da carreira como a rainha do R&B até as turnês em arenas lotadas nos anos 1980, Tina Turner abre a cortina e nos convida para seu mundo particular de uma forma que ela nunca fez antes. Revelando suas lutas mais pessoais e compartilhando alguns de seus momentos mais íntimos, TINA é o registro definidor e inspirador de uma das maiores sobreviventes da música moderna.","first_air_date":"2021-08-20","runtime":118,"episode_run_time":[118],"vote_average":7.7,"created_by":["HBO Documentary Films","Lightbox Entertainment","Media Finance Capital","Altitude Film Entertainment","Sky Original Productions"],"production_companies":[{"name":"HBO Documentary Films"},{"name":"Lightbox Entertainment"},{"name":"Media Finance Capital"},{"name":"Altitude Film Entertainment"},{"name":"Sky Original Productions"}],"cast":["Tina Turner","Angela Bassett","Oprah Winfrey","Kurt Loder","Katori Hall"],"backdrop_path":"https://image.tmdb.org/t/p/original/wuEiqcDu4Y0kQO6nXGVarKJGLtG.jpg","poster_path":"https://image.tmdb.org/t/p/original/g2Fm6iZr2LNwy8Nz2tY8Wgdo4vp.jpg","certification":"12","genres":["Documentário","Música","Cinema TV"],"trailer":"N/A"},
