"60747":{"id":"60747","name":"Amanhecer Violento","slug":"amanhecer-violento","original_title":"Red Dawn","overview":"O dia estava tranquilo até um grupo de pára-quedistas aterrissar no campo de futebol de um colégio. Era o início de uma invasão da Coreia do Norte ao território americano, o que gera pânico nos habitantes da cidade. Decididos a defender o local, oito jovens se escondem nas montanhas e, adotando o nome de sua equipe de futebol, The Wolverine, planejam como revidar à invasão das forças militares inimigas.","first_air_date":"2012-03-15","runtime":93,"episode_run_time":[93],"vote_average":5.7,"created_by":["Contrafilm"],"production_companies":[{"name":"Contrafilm"}],"cast":["Chris Hemsworth","Josh Peck","Josh Hutcherson","Isabel Lucas","Adrianne Palicki"],"backdrop_path":"https://image.tmdb.org/t/p/original/jFh87Hj9Yp8QQPYmcNBAZNaa4Y.jpg","poster_path":"https://image.tmdb.org/t/p/original/rq9EOXrBIWvDb5bey2vrUHlIui1.jpg","certification":"N/A","genres":["Ação","Thriller"],"trailer":"N/A"},
"11005":{"id":"11005","name":"Tempo de Despertar","slug":"tempo-de-despertar","original_title":"Awakenings","overview":"Bronx, 1969. Malcolm Sayer é um neurologista que conseguiu emprego em um hospital psiquiátrico. Lá ele encontra vários pacientes que aparentemente estão catatônicos, mas Sayer sente que eles estão só “adormecidos” e que se forem medicados da maneira certa poderão ser despertados. Assim pesquisa bem o assunto e chega à conclusão de que a L-DOPA, uma nova droga que já estava sendo usada para pacientes com o Mal de Parkinson, deve ser o medicamento ideal para este casos. No entanto, ao levar o assunto para o diretor, ele autoriza que apenas um paciente seja submetido ao tratamento.","first_air_date":"1990-12-04","runtime":121,"episode_run_time":[121],"vote_average":7.8,"created_by":["Parkes/Lasker productions"],"production_companies":[{"name":"Parkes/Lasker productions"}],"cast":["Robert De Niro","Robin Williams","John Heard","Julie Kavner","Penelope Ann Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/zP7DP2AmOCTgUa0nOMA2TLAjKqz.jpg","poster_path":"https://image.tmdb.org/t/p/original/v62IwQwi9TPgi2hZV8TUwxYsL0a.jpg","certification":"10","genres":["Drama"],"trailer":"N/A"},
