"681":{"id":"681","name":"007 Os Diamantes São Eternos","slug":"007-os-diamantes-sao-eternos","original_title":"Diamonds Are Forever","overview":"Quando o governo britânico suspeita da existência de uma rede mundial de contrabando de diamantes, 007 (Sean Connery) é chamado para investigar. Ele logo descobre a extensão do problema e viaja para a América, onde o milionário proprietário de um cassino é suspeito de estar por trás de tudo. Só que ele é ninguém menos que Ernst Stavro Blofeld (Charles Gray), o arquiinimigo de James Bond, que sabe exatamente o que tem de fazer, principalmente quando as mais poderosas potências nucleares do planeta estão envolvidas.","first_air_date":"1971-12-14","runtime":120,"episode_run_time":[120],"vote_average":6.4,"created_by":["EON Productions","United Artists"],"production_companies":[{"name":"EON Productions"},{"name":"United Artists"}],"cast":["Sean Connery","Jill St. John","Charles Gray","Lana Wood","Jimmy Dean"],"backdrop_path":"https://image.tmdb.org/t/p/original/pyTDtQCn5sG8gi2zkM5ZylSNmtJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/n0UhYapEWDcrgDgKvRKHZMyv4z6.jpg","certification":"12","genres":["Ação","Thriller"],"trailer":"N/A"},
