"1904":{"id":"1904","name":"Memórias de uma Gueixa","slug":"memorias-de-uma-gueixa","original_title":"Memoirs of a Geisha","overview":"Chiyo foi vendida a uma casa de gueixas quando ainda era menina, em 1929, onde é maltratada pelos donos e por Hatsumomo, uma gueixa que tem inveja de sua beleza. Acolhida por Mameha, a principal rival de Hatsumomo, Chiyo ao crescer se torna a gueixa Sayuri. Reconhecida, ela passa a desfrutar de uma sociedade repleta de riquezas e privilégios até que a 2ª Guerra Mundial modifica radicalmente sua realidade no Japão.","first_air_date":"2005-12-06","runtime":146,"episode_run_time":[146],"vote_average":7.7,"created_by":["Columbia Pictures","DreamWorks Pictures","Spyglass Entertainment","Amblin Entertainment","Red Wagon Entertainment"],"production_companies":[{"name":"Columbia Pictures"},{"name":"DreamWorks Pictures"},{"name":"Spyglass Entertainment"},{"name":"Amblin Entertainment"},{"name":"Red Wagon Entertainment"}],"cast":["Ziyi Zhang","巩俐","Michelle Yeoh","Ken Watanabe","Suzuka Ohgo"],"backdrop_path":"https://image.tmdb.org/t/p/original/zJDnqXtGNHUmexiaWNa52Vslve5.jpg","poster_path":"https://image.tmdb.org/t/p/original/w6gOSVEaC2gXFLtwIZPyci8IL2b.jpg","certification":"N/A","genres":["Drama","Romance","História"],"trailer":"N/A"},
