"335795":{"id":"335795","name":"Monster High: O Filme","slug":"monster-high-o-filme","original_title":"Monster High: The Movie","overview":"Conheça Clawdeen Wolf, que nasceu metade humana e metade lobisomem, depois que ela chega em sua nova escola, Monster High. Ela rapidamente faz amizade com suas colegas Frankie Stein e Draculaura, e pela primeira vez em sua vida, Clawdeen sente que finalmente encontrou um lugar onde ela se encaixa e pode realmente ser ela mesma, apesar de manter sua metade humana em segredo. Quando um plano desonesto para destruir Monster High ameaça revelar sua verdadeira identidade, Clawdeen deve aprender a abraçar seu verdadeiro coração de monstro e encontrar uma maneira de salvar o dia.","first_air_date":"2022-10-06","runtime":88,"episode_run_time":[88],"vote_average":6.9,"created_by":["Mattel Television","Brightlight Pictures","Nickelodeon Productions","Lighthouse Pictures","Mattel"],"production_companies":[{"name":"Mattel Television"},{"name":"Brightlight Pictures"},{"name":"Nickelodeon Productions"},{"name":"Lighthouse Pictures"},{"name":"Mattel"}],"cast":["Miia Harris","Ceci Balagot","Nayah Damasen","Jy Prishkulnik","Case Walker"],"backdrop_path":"https://image.tmdb.org/t/p/original/99wklPc31J1jVsPUUxpAQRQHx5I.jpg","poster_path":"https://image.tmdb.org/t/p/original/9dUOgkKhmPjsJ4pi5QkES5AubRP.jpg","certification":"L","genres":["Família","Fantasia","Comédia","Aventura"],"trailer":"gD_VtxBo-fU"},
