"859":{"id":"859","name":"Ligações Perigosas","slug":"ligacoes-perigosas","original_title":"Dangerous Liaisons","overview":"França, 1788. A Marquesa de Merteuil (Glenn Close) precisa de um favor do seu ex-amante, o Visconde de Valmont (John Malkovich), pois seu ex-marido está planejando se casar com uma jovem virgem e ela deseja que o Marquês, que é conhecido por sua vida devassa e suas conquistas amorosas, a seduza antes do dia do casamento. No entanto, ele tem outros planos, pois planeja conquistar uma bela mulher casada (Michelle Pfeiffer), que sempre se mostrou fiel ao marido e é religiosa. A Marquesa exige então uma prova escrita dos seus encontros amorosos e, se ele conseguir tal façanha, ela lhe promete como recompensa passarem uma noite juntos. Mas os jogos de sedução fogem do controle e os resultados são bem mais trágicos do que se podia imaginar.","first_air_date":"1988-12-21","runtime":119,"episode_run_time":[119],"vote_average":7.2,"created_by":["Lorimar Film Entertainment","NFH Films","Warner Bros. Pictures","Franco London Films","Lorimar Productions"],"production_companies":[{"name":"Lorimar Film Entertainment"},{"name":"NFH Films"},{"name":"Warner Bros. Pictures"},{"name":"Franco London Films"},{"name":"Lorimar Productions"}],"cast":["Glenn Close","John Malkovich","Michelle Pfeiffer","Swoosie Kurtz","Keanu Reeves"],"backdrop_path":"https://image.tmdb.org/t/p/original/gVw5NVGsGDhEeYUS1DeFWeLdQ16.jpg","poster_path":"https://image.tmdb.org/t/p/original/erQUeLHDC5G1rHAbA6zVED6Gacj.jpg","certification":"N/A","genres":["Drama","Romance"],"trailer":"N/A"},
