"2976":{"id":"2976","name":"Hairspray: Em Busca da Fama","slug":"hairspray-em-busca-da-fama","original_title":"Hairspray","overview":"Estamos nos anos 60. O sonho de todo adolescente da época é aparecer no \"The Corny Collins Show\", o programa de dança mais famoso da TV. Tracy Turnblad, uma grande garota com grande cabelo e coração maior ainda, tem só uma paixão na vida: dançar. Mesmo sendo gordinha para os padrões locais, ela impressiona os juízes com seu estilo e ganha espaço na atração. A garota se torna um sucesso, ameaçando a hegemonia de Amber von Tussle. O público ama Tracy. Mas a disputa se torna pessoal mesmo quando as duas passam a lutar pelo amor do jovem Link.","first_air_date":"2007-07-19","runtime":116,"episode_run_time":[116],"vote_average":6.7,"created_by":["Offspring Entertainment","New Line Cinema","Zadan / Meron Productions","Ingenious Media"],"production_companies":[{"name":"Offspring Entertainment"},{"name":"New Line Cinema"},{"name":"Zadan / Meron Productions"},{"name":"Ingenious Media"}],"cast":["Nikki Blonsky","John Travolta","Michelle Pfeiffer","Christopher Walken","Amanda Bynes"],"backdrop_path":"https://image.tmdb.org/t/p/original/dgamC6KzcHPEfuqdrV4z0yNawNp.jpg","poster_path":"https://image.tmdb.org/t/p/original/6xIvGhsiZeY5wKTKw8o0Fi7bey8.jpg","certification":"L","genres":["Comédia","Romance","Drama"],"trailer":"N/A"},
