"10663":{"id":"10663","name":"O Rei da Água","slug":"o-rei-da-agua","original_title":"The Waterboy","overview":"Criado pela mãe superprotetora Helen, Bobby Boucher Jr. é o rei da água de uma equipe de futebol americano de sucesso treinado por Red Beaulieu. Quando o treinador demite Bobby, ele vai para um time rival liderado pelo técnico Klein, que vê Bobby dando uma surra em um jogador que o caçoava e o escala. Logo, os jogadores de Klein estão na disputa pelo título.","first_air_date":"1998-11-06","runtime":90,"episode_run_time":[90],"vote_average":6.0,"created_by":["Touchstone Pictures"],"production_companies":[{"name":"Touchstone Pictures"}],"cast":["Adam Sandler","Kathy Bates","Henry Winkler","Fairuza Balk","Jerry Reed"],"backdrop_path":"https://image.tmdb.org/t/p/original/5efxViSwHrpJBw9tP3e22Z5OEXS.jpg","poster_path":"https://image.tmdb.org/t/p/original/uqzq9iS5UQz2EErqwyUtvwGBfnw.jpg","certification":"12","genres":["Comédia"],"trailer":"N/A"},
