"1428":{"id":"1428","name":"Era Uma vez no México","slug":"era-uma-vez-no-mexico","original_title":"Once Upon a Time in Mexico","overview":"O barão das drogas Barillo está planejando assassinar o presidente do México e tomar o poder. O corrupto agente da CIA Sands recruta o músico El Mariachi para deter os planos do criminoso. Mariachi estava aposentado desde a morte de sua esposa e filha e não quer mais matar, mas ele pode não ter escolha.","first_air_date":"2003-09-11","runtime":102,"episode_run_time":[102],"vote_average":6.3,"created_by":["Columbia Pictures","Dimension Films","Troublemaker Studios"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Dimension Films"},{"name":"Troublemaker Studios"}],"cast":["Antonio Banderas","Johnny Depp","Cheech Marin","Salma Hayek Pinault","Mickey Rourke"],"backdrop_path":"https://image.tmdb.org/t/p/original/ctDqJtlMwASOKoQi7sacSVae3EI.jpg","poster_path":"https://image.tmdb.org/t/p/original/cdSWDmDD7VVuBKlEar7H8abN1Ox.jpg","certification":"14","genres":["Ação","Drama","Mistério","Crime","Thriller"],"trailer":"N/A"},
"474335":{"id":"474335","name":"Tio Drew","slug":"tio-drew","original_title":"Uncle Drew","overview":"Dax é um grande fã de basquete, que atua como técnico de um time amador. Ele decide gastar todas as suas economias para garantir a presença de sua equipe em um campeonato de basquete de rua realizado no Harlem, Nova York, de olho no prêmio de US$ 100 mil ao vencedor. No entanto, após uma série de eventos desastrosos, ele perde o controle do grupo e precisa urgentemente formar uma nova equipe. Para resolver o problema, ele recruta uma grande lenda do esporte, o incrível tio Drew, que está aposentado há anos. Com um novo time repleto de setentões, Dax acredita que finalmente conseguirá alcançar uma vitória em sua carreira esportiva.","first_air_date":"2018-06-27","runtime":103,"episode_run_time":[103],"vote_average":6.7,"created_by":["Lionsgate","Summit Entertainment","Temple Hill Entertainment"],"production_companies":[{"name":"Lionsgate"},{"name":"Summit Entertainment"},{"name":"Temple Hill Entertainment"}],"cast":["Kyrie Irving","Lil Rel Howery","Shaquille O'Neal","Chris Webber","Reggie Miller"],"backdrop_path":"https://image.tmdb.org/t/p/original/604nkQ0s7ND7nrQorF0v9rSDpdf.jpg","poster_path":"https://image.tmdb.org/t/p/original/71XhS92iR7FKTFR7OKXq4MYNgTB.jpg","certification":"12","genres":["Comédia"],"trailer":"pf-FRI3FhqM"},
"1597":{"id":"1597","name":"Entrando Numa Fria","slug":"entrando-numa-fria","original_title":"Meet the Parents","overview":"A bela e apaixonada Pam, resolve levar seu namorado Greg para conhecer seus pais. Só que, ao chegar, o paizão da moça não se impressiona nem um pouco com o rapaz, e decide tornar seu final de semana insuportável. O objetivo é simples e cruel: se Greg aguentar até o fim, ele é o homem certo para se casar com sua filha. Mas será que ele aguenta?","first_air_date":"2000-10-06","runtime":108,"episode_run_time":[108],"vote_average":6.7,"created_by":["Universal Pictures","DreamWorks Pictures","Nancy Tenenbaum Films","Tribeca Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"DreamWorks Pictures"},{"name":"Nancy Tenenbaum Films"},{"name":"Tribeca Productions"}],"cast":["Ben Stiller","Robert De Niro","Teri Polo","Blythe Danner","Nicole DeHuff"],"backdrop_path":"https://image.tmdb.org/t/p/original/qcVrlyPFlPgCsmzorvELvpJN9Be.jpg","poster_path":"https://image.tmdb.org/t/p/original/reRrNOxZkjPUi7CeyQuHqNdWMqk.jpg","certification":"12","genres":["Comédia","Romance"],"trailer":"N/A"},
"500006":{"id":"500006","name":"Utøya - 22 de Julho","slug":"ut-ya-22-de-julho","original_title":"Utøya 22. juli","overview":"No pior dia da história norueguesa moderna, Kaja (Andrea Berntzen) se diverte com sua irmã mais nova Emilie (Elli Rhiannon Müller Osbourne), doze minutos antes da primeira bomba chegar ao acampamento de verão na ilha Utøya. Foi o segundo ataque terrorista de Anders Behring Breivik, em menos de duas horas, e matou 69 pessoas. Kaja representa o pânico, medo e desespero dos 500 jovens enquanto busca sua irmã na floresta.","first_air_date":"2018-03-09","runtime":92,"episode_run_time":[92],"vote_average":7.2,"created_by":["Paradox Produksjon"],"production_companies":[{"name":"Paradox Produksjon"}],"cast":["Andrea Berntzen","Aleksander Holmen","Brede Fristad","Elli Rhiannon Müller Osborne","Jenny Svennevig"],"backdrop_path":"https://image.tmdb.org/t/p/original/w4pUYpFTywnCn40NV9XKy2Wdacv.jpg","poster_path":"https://image.tmdb.org/t/p/original/vRTNX2KhxwSXynzxWQrJMW5kLFi.jpg","certification":"N/A","genres":["História","Drama"],"trailer":"N/A"},
