"353577":{"id":"353577","name":"Amor à Primeira Vista","slug":"amor-a-primeira-vista","original_title":"Love at First Sight","overview":"Em um voo para Londres, dois estranhos sentem uma conexão, mas logo se perdem no aeroporto. O reencontro parece impossível, só que o amor desafia todas as probabilidades.","first_air_date":"2023-09-15","runtime":90,"episode_run_time":[90],"vote_average":7.2,"created_by":["ACE Pictures Entertainment"],"production_companies":[{"name":"ACE Pictures Entertainment"}],"cast":["Haley Lu Richardson","Ben Hardy","Rob Delaney","Katrina Nare","Jameela Jamil"],"backdrop_path":"https://image.tmdb.org/t/p/original/gz1Lr0WcKJ1eg7mfN0AfAPXbI7h.jpg","poster_path":"https://image.tmdb.org/t/p/original/3a13ifmIiOsgKoQpOpDfsWCx4Qh.jpg","certification":"12","genres":["Romance","Drama"],"trailer":"N/A"},
"16320":{"id":"16320","name":"Serenity: A Luta Pelo Amanhã","slug":"serenity-a-luta-pelo-amanha","original_title":"Serenity","overview":"O Capitão Malcolm Reynalds, um veterano da guerra civil galáctica, agora vive em sua nave, Serenity. Ele coordena uma pequena, mas elétrica equipe. Quando Malcom pega dois novos passageiros: um jovem doutor e sua telepática irmã, as surpresas são maiores do que ele poderia imaginar. A dupla é fugitiva da coalizão dominante do universo e assim Serenity se vê entre a imensa força militar da Aliança, a grande fúria de Reavers e outro perigo a espreita dentro de sua própria nave.","first_air_date":"2005-09-25","runtime":118,"episode_run_time":[118],"vote_average":7.4,"created_by":["Universal Pictures","Barry Mendel Productions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Barry Mendel Productions"}],"cast":["Nathan Fillion","Summer Glau","Gina Torres","Alan Tudyk","Morena Baccarin"],"backdrop_path":"https://image.tmdb.org/t/p/original/f9vGIwNFIfctU7vd4rg85csnMZm.jpg","poster_path":"https://image.tmdb.org/t/p/original/gfYHx3atJPUW0fCpQ0Kg8ZGDAnX.jpg","certification":"N/A","genres":["Ficção científica","Ação","Aventura","Thriller"],"trailer":"5Xj0xWeshMg"},
"305470":{"id":"305470","name":"Power Rangers","slug":"power-rangers","original_title":"Power Rangers","overview":"A jornada de cinco adolescentes que devem buscar algo extraordinário quando eles tomam consciência que a sua pequena cidade Angel Grove - e o mundo - estão à beira de sofrer um ataque alienígena. Escolhidos pelo destino, eles irão descobrir que são os únicos que poderão salvar o planeta. Mas para isso, eles devem superar seus problemas pessoais e juntarem sua forças, antes que seja tarde demais.","first_air_date":"2017-03-23","runtime":124,"episode_run_time":[124],"vote_average":6.3,"created_by":["Lionsgate","Saban Brands","Saban Films","Temple Hill Entertainment","TIK Films"],"production_companies":[{"name":"Lionsgate"},{"name":"Saban Brands"},{"name":"Saban Films"},{"name":"Temple Hill Entertainment"},{"name":"TIK Films"}],"cast":["Dacre Montgomery","RJ Cyler","Ludi Lin","Naomi Scott","Becky G"],"backdrop_path":"https://image.tmdb.org/t/p/original/2vcdZBbf7sPPzIHfN5ial24UbxK.jpg","poster_path":"https://image.tmdb.org/t/p/original/69Eheo6f01q9T5Af1498oIRPcEC.jpg","certification":"10","genres":["Ação","Aventura","Ficção científica"],"trailer":"JoTJ3TBEc7c"},
"1281":{"id":"1281","name":"Mr. Bean - O Filme","slug":"mr-bean-o-filme","original_title":"Bean","overview":"Em pleno Outono de 1997, uma galeria americana decide comprar, através da dádiva de um milionário, um importantíssimo quadro que estava em Paris. Para reforçar a importância do acontecimento a galeria pediu à Royal National Gallery de Inglaterra que enviasse o seu mais ilustre conhecedor de arte no sentido deste apresentar a obra. Este seria o maior erro da história da Grierson Gallery, pois os Ingleses não lhe iriam disponibilizar a pessoa que eles tanto pretendiam. O \"escolhido\" seria o empregado mais detestável que possuíam, pois era a única forma que encontraram para se verem livres dele. Quem é o famoso empregado? Mr. Bean. 007 é o seu Q.I.","first_air_date":"1997-07-03","runtime":90,"episode_run_time":[90],"vote_average":6.5,"created_by":["Working Title Films","Tiger Aspect","PolyGram Filmed Entertainment"],"production_companies":[{"name":"Working Title Films"},{"name":"Tiger Aspect"},{"name":"PolyGram Filmed Entertainment"}],"cast":["Rowan Atkinson","Peter MacNicol","Pamela Reed","Tricia Vessey","Andrew Lawrence"],"backdrop_path":"https://image.tmdb.org/t/p/original/xvBvwR3NWn1K8YcByJJhB7pYoKu.jpg","poster_path":"https://image.tmdb.org/t/p/original/yoFGuw59e1KPFSwzrQexBL5khMx.jpg","certification":"L","genres":["Família","Aventura","Comédia"],"trailer":"N/A"},
"3597":{"id":"3597","name":"Eu Sei o Que Vocês Fizeram no Verão Passado","slug":"eu-sei-o-que-voces-fizeram-no-verao-passado","original_title":"I Know What You Did Last Summer","overview":"Após um acidente numa estrada sinuosa, quatro adolescentes cometem o terrível erro de jogar o corpo da vítima no mar. Mas, exatamente um ano depois, o homem morto retorna das profundezas, e não quer apenas um pedido de desculpas.","first_air_date":"1997-10-17","runtime":101,"episode_run_time":[101],"vote_average":6.0,"created_by":["Summer Knowledge LLC","Mandalay Entertainment","Columbia Pictures","Original Film"],"production_companies":[{"name":"Summer Knowledge LLC"},{"name":"Mandalay Entertainment"},{"name":"Columbia Pictures"},{"name":"Original Film"}],"cast":["Jennifer Love Hewitt","Sarah Michelle Gellar","Freddie Prinze Jr.","Ryan Phillippe","Bridgette Wilson-Sampras"],"backdrop_path":"https://image.tmdb.org/t/p/original/tU5CdvDGQRGMfjDIfWmeUKh3ZKk.jpg","poster_path":"https://image.tmdb.org/t/p/original/yt1MWtTpv4ToQgAcZcT2VA2AzWE.jpg","certification":"16","genres":["Terror","Thriller","Mistério"],"trailer":"N/A"},
"766798":{"id":"766798","name":"Mães Paralelas","slug":"maes-paralelas","original_title":"Madres paralelas","overview":"Duas mulheres, Janis e Ana, dividem o quarto de hospital onde vão dar à luz. As duas são solteiras e ficaram grávidas acidentalmente. Janis, de meia-idade, não se arrepende e nas horas prévias ao parto sente-se pletórica, a outra, Ana, é uma adolescente e está assustada, arrependida e traumatizada. Janis tenta animá-la enquanto passeiam como sonâmbulas pelo corredor do hospital. As poucas palavras que trocam nessas horas vão criar um vínculo muito profundo entre as duas, e esse acaso vai encarregar-se de desenvolver e complicar de forma tão retumbante que mudará a vida de ambas para sempre.","first_air_date":"2021-10-08","runtime":123,"episode_run_time":[123],"vote_average":6.8,"created_by":["El Deseo","TVE"],"production_companies":[{"name":"El Deseo"},{"name":"TVE"}],"cast":["Penélope Cruz","Milena Smit","Israel Elejalde","Aitana Sánchez-Gijón","Rossy de Palma"],"backdrop_path":"https://image.tmdb.org/t/p/original/w81qHqr1CdbdRco8jpmu6lXMqyk.jpg","poster_path":"https://image.tmdb.org/t/p/original/uguW6OmnV5wgcuNYev7y77rJcrU.jpg","certification":"14","genres":["Drama"],"trailer":"50cJUKw9RU8"},
