"2525":{"id":"2525","name":"A Bíblia... No Início","slug":"a-biblia-no-inicio","original_title":"The Bible: In the Beginning...","overview":"As maiores histórias do antigo testamento são trazidas para as telas com um domínio e força impressionantes neste filme internacional, que exibe os 22 primeiros capítulos do Gênesis. Esta é a história espetacular do homem, de sua queda, sua sobrevivência e sua fé indomável no futuro. Dando brilho à grandiosidade épica, temos as interpretações de George C. Scott como Abrão, Ava Garner como Sara e Peter O'Toole como a presença evocativa do anjo de Deus. O lendário John Huston dirige esta obra e também apresenta uma interpretação digna de nota como Noé. Da abertura do filme em meio ao caos cósmico até sua mensagem de esperança e salvação, A Bíblia mantém a todo momento sua característica de uma conquista monumental do cinema.","first_air_date":"1966-09-28","runtime":174,"episode_run_time":[174],"vote_average":7.3,"created_by":["Thalia AG","DDL Cinematografica","Seven Arts Productions","20th Century Fox"],"production_companies":[{"name":"Thalia AG"},{"name":"DDL Cinematografica"},{"name":"Seven Arts Productions"},{"name":"20th Century Fox"}],"cast":["Michael Parks","Ulla Bergryd","Richard Harris","John Huston","Stephen Boyd"],"backdrop_path":"https://image.tmdb.org/t/p/original/6xBqZoj40gIAyLSuemwI38c6OID.jpg","poster_path":"https://image.tmdb.org/t/p/original/n9VRNMf7HxuBGcv3NYeD9SK48Ik.jpg","certification":"N/A","genres":["Aventura","História","Drama"],"trailer":"N/A"},
