"10027":{"id":"10027","name":"Cão de Briga","slug":"cao-de-briga","original_title":"Unleashed","overview":"Desde que Bart tirou Danny da rua, com a idade de 4 anos, sempre o tratou como um cão, treinando-o literalmente para o ataque. Danny é hoje sua grande arma, capaz de se atirar sobre qualquer um com uma simples ordem. Isolado do mundo, Danny não tem outra escolha a não ser aceitar essa existência de animal. Mas as coisas mudam quando ele conhece Sam, um cego que ganha a vida como afinador de pianos. Sam faz Danny descobrir um lado humano que até então lhe era desconhecido.","first_air_date":"2005-02-02","runtime":103,"episode_run_time":[103],"vote_average":6.9,"created_by":["EuropaCorp","Danny the Dog Productions","TF1 Films Production","Qian Yian International","Current Entertainment","Producciones España"],"production_companies":[{"name":"EuropaCorp"},{"name":"Danny the Dog Productions"},{"name":"TF1 Films Production"},{"name":"Qian Yian International"},{"name":"Current Entertainment"},{"name":"Producciones España"}],"cast":["Jet Li","Morgan Freeman","Bob Hoskins","Kerry Condon","Vincent Regan"],"backdrop_path":"https://image.tmdb.org/t/p/original/z8ejhyO0hVXk4KVo1bi4HMFP3FS.jpg","poster_path":"https://image.tmdb.org/t/p/original/l0yMxpDDqs1WdDfMrG3ZZK34UTi.jpg","certification":"N/A","genres":["Ação","Crime"],"trailer":"N/A"},
