"11620":{"id":"11620","name":"Quo Vadis","slug":"quo-vadis","original_title":"Quo Vadis","overview":"Após três anos em campanha, o general Marcus Vinicius (Robert Taylor) retorna à Roma e encontra Lygia (Deborah Kerr), por quem se apaixona. Ela é uma cristã e não quer nenhum envolvimento com um guerreiro. Mas, apesar de ter sido criada como romana, Lygia é a filha adotiva de um general aposentado e, teoricamente, uma refém de Roma. Marcus procura o imperador Nero (Peter Ustinov), para que ela lhe seja dada pelos serviços que ele fez. Lygia se ressente, mas de alguma forma se apaixona por Marcus. Enquanto isso, as atrocidades de Nero são cada vez mais ultrajantes e, quando ele queima Roma e culpa os cristãos, Marcus salva Lygia e a família dela. Nero captura todos os cristãos e os atira aos leões mas, no final, Marcus, Lygia e o cristianismo prevalecerão. Na filmagem da obra de Sienkiewicz, foram utilizados cerca de 32 mil figurinos e milhares de figurantes, dentre eles então os 'desconhecidos' Bud Spencer, Sophia Loren (então com 17 anos) e Elizabeth Taylor.","first_air_date":"1951-11-08","runtime":171,"episode_run_time":[171],"vote_average":7.1,"created_by":["Metro-Goldwyn-Mayer"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"}],"cast":["Robert Taylor","Deborah Kerr","Leo Genn","Peter Ustinov","Patricia Laffan"],"backdrop_path":"https://image.tmdb.org/t/p/original/goyLlBUlfZwbKIJFvPbRmpkKYZ.jpg","poster_path":"https://image.tmdb.org/t/p/original/n8SvyuJK1lwx5lISE4J1VwF8KTU.jpg","certification":"N/A","genres":["Drama","História","Romance"],"trailer":"N/A"},
