"339527":{"id":"339527","name":"Presságios de um Crime","slug":"pressagios-de-um-crime","original_title":"Solace","overview":"Dois detetives do FBI, Joe Merriwether e Katherine Cowles perseguem um serial killer conhecido por matar suas vítimas com um objeto perfurante na nuca, sem deixar vestígios na cena do crime. Diante da ausência de provas, Joe pede ajuda ao seu amigo pessoal, o Doutor John Clancy, um poderoso vidente que vive isolado desde a morte de sua filha. Aos poucos, este novo investigador ajuda os policiais a entender a mente do assassino, até fazer uma descoberta importante: o homem responsável pelas mortes também é um vidente, ainda mais esperto que John. Pior do que isso, ele está sempre um passo à frente nas investigações.","first_air_date":"2015-09-03","runtime":101,"episode_run_time":[101],"vote_average":6.4,"created_by":["Venture Forth","Grindstone Entertainment Group","Lionsgate Premiere","Eden Rock Media","FilmNation Entertainment","Flynn Picture Company","Silver Reel","Supersensory","Black Maria"],"production_companies":[{"name":"Venture Forth"},{"name":"Grindstone Entertainment Group"},{"name":"Lionsgate Premiere"},{"name":"Eden Rock Media"},{"name":"FilmNation Entertainment"},{"name":"Flynn Picture Company"},{"name":"Silver Reel"},{"name":"Supersensory"},{"name":"Black Maria"}],"cast":["Anthony Hopkins","Jeffrey Dean Morgan","Abbie Cornish","Colin Farrell","Matt Gerald"],"backdrop_path":"https://image.tmdb.org/t/p/original/z8pQocUi56yIAToFjrmSumQ7VAL.jpg","poster_path":"https://image.tmdb.org/t/p/original/lQAL1R0w5q1TdYjet8sv6KUbZ0v.jpg","certification":"14","genres":["Thriller","Crime","Mistério"],"trailer":"N/A"},
