"79":{"id":"79","name":"Herói","slug":"heroi","original_title":"英雄","overview":"Quando a China estava dividida em sete reinos que lutavam entre si pela hegemonia, a miséria e a morte assolaram o país. O rei Qin, obcecado pela ideia de unificar a China e tornar-se o primeiro imperador, sofre ataques de outros monarcas que o tentaram assassinar. Qin promete poder, riquezas e uma audiência privada a quem conseguir derrotar os assassinos, mas essa é uma tarefa quase impossível. Por isso, quando o enigmático \"Sem Nome\" chega ao palácio com as armas dos lendários assassinos, o rei está ansioso por ouvir a sua história.","first_air_date":"2002-07-22","runtime":120,"episode_run_time":[120],"vote_average":7.5,"created_by":["Beijing New Picture Film Co. Ltd.","China Film Co-Production Corp.","Elite Group Enterprises","Edko Films","Sil-Metropole Organisation","Zhang Yimou Studio"],"production_companies":[{"name":"Beijing New Picture Film Co. Ltd."},{"name":"China Film Co-Production Corp."},{"name":"Elite Group Enterprises"},{"name":"Edko Films"},{"name":"Sil-Metropole Organisation"},{"name":"Zhang Yimou Studio"}],"cast":["Jet Li","Tony Chiu-Wai Leung","Maggie Cheung","Donnie Yen","Ziyi Zhang"],"backdrop_path":"https://image.tmdb.org/t/p/original/jDz6RYN3nKYtlo7J9IMvGoJit7B.jpg","poster_path":"https://image.tmdb.org/t/p/original/bCxoK5adJ4bf8lQBTYoyiGQSw9u.jpg","certification":"N/A","genres":["Drama","Aventura","Ação","História"],"trailer":"N/A"},
"6878":{"id":"6878","name":"A Incrível Jornada","slug":"a-incrivel-jornada","original_title":"Homeward Bound: The Incredible Journey","overview":"Chance é um Buldog trapalhão e tem como melhores amigos Sassy, uma charmosa e engraçada gatinha que se comporta como uma princesa, e Shadow, um dócil e esperto cão da raça Golden Retriever. A incrível aventura começa quando estes irresistíveis animais de estimação decidem voltar para casa sozinhos, sem a ajuda de ninguém, depois de terem sido separados de seus donos, os quais adoram. Nessa incrível aventura de volta para casa, o trio atravessa montanhas, enfrenta grandes perigos, animais ferozes e as dificuldades do caminho proporcionadas pela natureza.","first_air_date":"1993-02-03","runtime":84,"episode_run_time":[84],"vote_average":7.0,"created_by":["Touchwood Pacific Partners 1","Walt Disney Pictures"],"production_companies":[{"name":"Touchwood Pacific Partners 1"},{"name":"Walt Disney Pictures"}],"cast":["Michael J. Fox","Sally Field","Don Ameche","Kevin Chevalia","Benj Thall"],"backdrop_path":"https://image.tmdb.org/t/p/original/xDwDhLtQnA7jK4f7DVkdeSvZnAp.jpg","poster_path":"https://image.tmdb.org/t/p/original/5VJch78cJlbw5CjVbNCUMZS5uCx.jpg","certification":"N/A","genres":["Aventura","Comédia","Família"],"trailer":"N/A"},
