"6538":{"id":"6538","name":"Jogos do Poder","slug":"jogos-do-poder","original_title":"Charlie Wilson's War","overview":"Início dos anos 80. A União Soviética invade o Afeganistão, o que chama a atenção de políticos norte-americanos. Um deles é Charlie Wilson (Tom Hanks), um homem mulherengo e polêmico que não tem grande relevância política, apesar de ter sido eleito 6 vezes para o cargo. Com o apoio de Joanne Herring (Julia Roberts), uma das mulheres mais ricas do estado que o elege, e do agente da CIA Gust Avrakotos (Philip Seymour Hoffman), Wilson passa a negociar uma aliança entre paquistaneses, egípcios, israelenses e o governo norte-americano, de forma que os Estados Unidos financiem uma resistência que possa impedir o avanço soviético no local.","first_air_date":"2007-12-19","runtime":102,"episode_run_time":[102],"vote_average":6.5,"created_by":["Universal Pictures","Relativity Media","Participant","Playtone","MP Munich Pape Filmproductions"],"production_companies":[{"name":"Universal Pictures"},{"name":"Relativity Media"},{"name":"Participant"},{"name":"Playtone"},{"name":"MP Munich Pape Filmproductions"}],"cast":["Tom Hanks","Julia Roberts","Philip Seymour Hoffman","Amy Adams","Emily Blunt"],"backdrop_path":"https://image.tmdb.org/t/p/original/6MyFH4phzKMxdvuk8ZfI1fohMz7.jpg","poster_path":"https://image.tmdb.org/t/p/original/rgqjxbVNaJAo4dNNOiLNhrkxoTq.jpg","certification":"14","genres":["Comédia","Drama","História"],"trailer":"N/A"},
