"9481":{"id":"9481","name":"O Colecionador de Ossos","slug":"o-colecionador-de-ossos","original_title":"The Bone Collector","overview":"A policial Amelia Donaghy está na perseguição de um assassino em série cujo cartão de visita é um pequeno pedaço de osso extraído de cada uma de suas vítimas. Incapaz de decifrar as pistas enigmáticas que o assassino deixa para trás na cena do crime, Amelia apela para o tetraplégico especialista em criminologia forense, Lincoln Rhyme, para ajudar. Com ela agindo como intermediária de Rhyme, os dois se juntam na esperança de descobrir quem pode ser a próxima vítima.","first_air_date":"1999-11-04","runtime":118,"episode_run_time":[118],"vote_average":6.8,"created_by":["Universal Pictures","Columbia Pictures"],"production_companies":[{"name":"Universal Pictures"},{"name":"Columbia Pictures"}],"cast":["Denzel Washington","Angelina Jolie","Queen Latifah","Michael Rooker","Michael McGlone"],"backdrop_path":"https://image.tmdb.org/t/p/original/kyWxlSCDqMXlLg8Kpvw2d2AOf5G.jpg","poster_path":"https://image.tmdb.org/t/p/original/sljvAAegS4up3fT4P51UNwVmNvu.jpg","certification":"14","genres":["Drama","Mistério","Thriller","Crime"],"trailer":"VHAZ6ouxUak"},
"9367":{"id":"9367","name":"O Mariachi","slug":"o-mariachi","original_title":"El Mariachi","overview":"Mariachi é um cantor popular, que vai de cidade em cidade apresentando seu repertório em troca de dinheiro para sobreviver. Ao chegar a um pequeno vilarejo, ele acreditava ser este seu dia de sorte, pois logo no segundo bar que visita já consegue trabalho como seresteiro. O que ele não sabe é que, no momento de sua chegada, pistoleiros locais estão à espera de um inimigo assassino, que veste preto e carrega consigo caixas de violão idênticas. Não demora muito para que Mariachi seja perseguido.","first_air_date":"1993-02-22","runtime":82,"episode_run_time":[82],"vote_average":6.7,"created_by":["Los Hooligans Productions"],"production_companies":[{"name":"Los Hooligans Productions"}],"cast":["Carlos Gallardo","Consuelo Gómez","Jaime de Hoyos","Peter Marquardt","Reinol Martinez"],"backdrop_path":"https://image.tmdb.org/t/p/original/zERY2aaCrLExpR6NQ1ceIs0WG8S.jpg","poster_path":"https://image.tmdb.org/t/p/original/kPmLM0jXVKRwUUK69qzOEd9K8e2.jpg","certification":"14","genres":["Ação","Crime","Thriller","Faroeste"],"trailer":"N/A"},
