"2149":{"id":"2149","name":"Corpo em Evidência","slug":"corpo-em-evidencia","original_title":"Body of Evidence","overview":"Andrew Marsh (Michael Forest) é um milionário que foi encontrado morto na cama, aparentemente assassinado devido à presença de vestígios de cocaína em seu sangue. A principal suspeita é Rebecca Carlson (Madonna), sua namorada, que é bem mais nova que ele e é a principal beneficiada no testamento. Antes mesmo de ser chamada pela polícia, Rebecca resolve contratar Frank Dulaney (Willem Dafoe) como seu advogado. Ao conhecê-la melhor Frank passa a descofiar que o estilo sexual agressivo de sua cliente possa ter causado a morte de Andrew.","first_air_date":"1993-01-15","runtime":101,"episode_run_time":[101],"vote_average":5.0,"created_by":["Metro-Goldwyn-Mayer","Constantin Film"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"Constantin Film"}],"cast":["Madonna","Willem Dafoe","Julianne Moore","Anne Archer","Jürgen Prochnow"],"backdrop_path":"https://image.tmdb.org/t/p/original/iX2iZRK87QgZC0y42Z6AJM5QVbD.jpg","poster_path":"https://image.tmdb.org/t/p/original/eBneWfOBMbI7nQoKroDcF5PCivl.jpg","certification":"N/A","genres":["Drama","Thriller","Romance"],"trailer":"N/A"},
"11820":{"id":"11820","name":"O Sorriso de Monalisa","slug":"o-sorriso-de-monalisa","original_title":"Mona Lisa Smile","overview":"Katharine Watson (Julia Roberts) é uma recém-graduada professora que consegue emprego no conceituado colégio Wellesley, para lecionar aulas de História da Arte. Incomodada com o conservadorismo da sociedade e do próprio colégio em que trabalha, Katharine decide lutar contra estas normas e acaba inspirando suas alunas a enfrentarem os desafios da vida.","first_air_date":"2003-12-19","runtime":117,"episode_run_time":[117],"vote_average":6.9,"created_by":["Columbia Pictures","Revolution Studios","Red Om Films"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Revolution Studios"},{"name":"Red Om Films"}],"cast":["Julia Roberts","Kirsten Dunst","Julia Stiles","Maggie Gyllenhaal","Ginnifer Goodwin"],"backdrop_path":"https://image.tmdb.org/t/p/original/trfjdJI51Krnig9UmxJQkz15ICo.jpg","poster_path":"https://image.tmdb.org/t/p/original/ImjEyKaxAspC5TcUslkeTYveHv.jpg","certification":"12","genres":["Drama","História","Romance"],"trailer":"N/A"},
