"12096":{"id":"12096","name":"A Pantera Cor-de-Rosa","slug":"a-pantera-cor-de-rosa","original_title":"The Pink Panther","overview":"Jacques Clouseau (Steve Martin) é um atrapalhado policial francês, que trabalha em uma pequena cidade. Após ser chamado a Paris pelo inspetor-chefe Dreyfus (Kevin Kline), Clouseau é promovido a inspetor e fica encarregado de investigar a morte de Yves Gluant (Jason Statham), técnico de um time de futebol local. Logo após a morte de Gluant, foi roubado dele o diamante conhecido como Pantera Cor-de-Rosa, que estava em um anel. O plano de Dreyfus é usar Clouseau para que ele chame a atenção da mídia, enquanto que outros inspetores, mais gabaritados, trabalhem para resolver o caso. Entretanto, juntamente com seu parceiro Gilbert Ponton (Jean Reno) e sua secretária Nicole (Emily Mortimer), Clouseau inesperadamente chega perto do assassino.","first_air_date":"2006-02-10","runtime":93,"episode_run_time":[93],"vote_average":5.8,"created_by":["Metro-Goldwyn-Mayer","Columbia Pictures","Robert Simonds Productions"],"production_companies":[{"name":"Metro-Goldwyn-Mayer"},{"name":"Columbia Pictures"},{"name":"Robert Simonds Productions"}],"cast":["Steve Martin","Jean Reno","Kevin Kline","Beyoncé","Emily Mortimer"],"backdrop_path":"https://image.tmdb.org/t/p/original/m10v2akkOffv5YE9EUwc1PHknvg.jpg","poster_path":"https://image.tmdb.org/t/p/original/yK5NHMoFVpmGoNCx2ghPVCWdT0Y.jpg","certification":"N/A","genres":["Comédia","Mistério","Crime","Aventura","Família"],"trailer":"N/A"},
"9335":{"id":"9335","name":"Carga Explosiva 2","slug":"carga-explosiva-2","original_title":"Transporter 2","overview":"Frank Martin é um ex-agente das Forças Especiais que trabalha atualmente como transportador de itens valiosos. Frank atualmente trabalha para a poderosa família Billings, como favor a um amigo. Aos poucos ele fica próximo ao pequeno Jack Billings, de 6 anos, a quem leva e traz da escola. Quando Jack é sequestrado Frank é obrigado a mais uma vez pôr suas habilidades em ação, partindo em uma tentativa de resgate.","first_air_date":"2005-08-03","runtime":88,"episode_run_time":[88],"vote_average":6.3,"created_by":["EuropaCorp","TF1 Films Production","Current Entertainment","Canal+","TPS Star","20th Century Fox"],"production_companies":[{"name":"EuropaCorp"},{"name":"TF1 Films Production"},{"name":"Current Entertainment"},{"name":"Canal+"},{"name":"TPS Star"},{"name":"20th Century Fox"}],"cast":["Jason Statham","Amber Valletta","Alessandro Gassmann","Kate Nauta","Matthew Modine"],"backdrop_path":"https://image.tmdb.org/t/p/original/mSb2FyXPAVnLsdDiHAoAdLsZcak.jpg","poster_path":"https://image.tmdb.org/t/p/original/4Vo1KYTe0LWakRxTwp3scw8Ti6u.jpg","certification":"14","genres":["Ação","Thriller","Crime"],"trailer":"N/A"},
"829280":{"id":"829280","name":"Enola Holmes 2","slug":"enola-holmes-2","original_title":"Enola Holmes 2","overview":"Depois dos eventos de Enola Holmes, o segundo filme acompanha Enola (Millie Bobby Brown) em um caso \"de verdade!\". Agora uma detetive de aluguel igual ao seu irmão, Sherlock (Henry Cavill), a detetive assume seu primeiro caso oficial. Enola é requisitada para achar uma garota desaparecida, mas à medida que sua investigação continua, ela descobre que há muito mais em jogo do que apenas um desaparecimento. As faíscas de uma perigosa conspiração acendem um mistério que requer a ajuda de amigos – incluindo a dos seus irmãos – para desvendar.","first_air_date":"2022-11-30","runtime":128,"episode_run_time":[128],"vote_average":7.4,"created_by":["Legendary Pictures","PCMA Productions"],"production_companies":[{"name":"Legendary Pictures"},{"name":"PCMA Productions"}],"cast":["Millie Bobby Brown","Henry Cavill","David Thewlis","Louis Partridge","Susan Wokoma"],"backdrop_path":"https://image.tmdb.org/t/p/original/n2OaA7Je0fgcVnfJM7xDJoPny7x.jpg","poster_path":"https://image.tmdb.org/t/p/original/tegBpjM5ODoYoM1NjaiHVLEA0QM.jpg","certification":"N/A","genres":["Aventura","Mistério","Crime"],"trailer":"N/A"},
"4584":{"id":"4584","name":"Razão e Sensibilidade","slug":"razao-e-sensibilidade","original_title":"Sense and Sensibility","overview":"Em virtude da morte do marido, uma viúva e as três filhas passam a enfrentar dificuldades financeiras, pois praticamente toda a herança foi para um filho do primeiro casamento, que ignora a promessa feita no leito de morte de seu pai que ampararia as meias-irmãs. Neste contexto, enquanto uma irmã prática (Emma Thompson), usando a razão como principal forma de conduzir as situações, a outra (Kate Winslet) se mostra emotiva, sem se reprimir nunca com uma sensibilidade flor da pele.","first_air_date":"1995-12-13","runtime":136,"episode_run_time":[136],"vote_average":7.4,"created_by":["Columbia Pictures","Mirage Enterprises","Good Machine"],"production_companies":[{"name":"Columbia Pictures"},{"name":"Mirage Enterprises"},{"name":"Good Machine"}],"cast":["Emma Thompson","Kate Winslet","Alan Rickman","Hugh Grant","Gemma Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/mZfkW31Y9a8DvISpO9nj5Tc7neo.jpg","poster_path":"https://image.tmdb.org/t/p/original/avfV8Se2eTfmFAZf0aAPOdq2WcV.jpg","certification":"L","genres":["Drama","Romance"],"trailer":"wHVHC4G5WEE"},
