"2112":{"id":"2112","name":"O Troco","slug":"o-troco","original_title":"Payback","overview":"Porter e Val Resnick assaltam uma gangue de chineses e roubam 140 mil dólares. Porter se dá por satisfeito, apesar de esperar entre 350 mil e meio milhão de dólares, mas Val não, pois precisava de 130 mil dólares para saldar suas dívidas e ser aceito na Organização. Assim, com a ajuda de Lynn, a esposa de Porter, Val o trai e Porter é baleado e dado como morto. Mas após algum tempo ele reaparece, decidido a receber os 70 mil dólares da sua parte, mesmo que para isto tenha de enfrentar toda a \"Organização\". Mas existe uma forte possibilidade que ele morra tentando e nesta louca tentativa conta apenas com Rosie, uma garota de programa bastante exclusiva com quem tinha se envolvido, quando era seu segurança e motorista.","first_air_date":"1999-02-05","runtime":100,"episode_run_time":[100],"vote_average":6.8,"created_by":["Icon Productions","Paramount Pictures"],"production_companies":[{"name":"Icon Productions"},{"name":"Paramount Pictures"}],"cast":["Mel Gibson","Gregg Henry","Maria Bello","David Paymer","Bill Duke"],"backdrop_path":"https://image.tmdb.org/t/p/original/fP9QYH8T9LBnsvnQvcqetB4nuwX.jpg","poster_path":"https://image.tmdb.org/t/p/original/mSGcpMrmiP6kauaGdy7ZbXXNlHS.jpg","certification":"18","genres":["Ação","Drama","Crime","Thriller"],"trailer":"N/A"},
"314095":{"id":"314095","name":"Z: A Cidade Perdida","slug":"z-a-cidade-perdida","original_title":"The Lost City of Z","overview":"A incrível história real do explorador britânico Percy Fawcett (Charlie Hunnam), que viaja para a Amazônia no século XX e descobre evidências de uma civilização avançada desconhecida que pode ter habitado a região. Depois de ter sido ridicularizado pelo corpo científico que considera as populações indígenas como \"selvagens\", Fawcett está determinado a retornar à sua amada selva e provar seu caso.","first_air_date":"2017-03-15","runtime":141,"episode_run_time":[141],"vote_average":6.4,"created_by":["Northern Ireland Screen","Plan B Entertainment","Sierra/Affinity","MICA Entertainment","MadRiver Pictures","Keep Your Head Productions"],"production_companies":[{"name":"Northern Ireland Screen"},{"name":"Plan B Entertainment"},{"name":"Sierra/Affinity"},{"name":"MICA Entertainment"},{"name":"MadRiver Pictures"},{"name":"Keep Your Head Productions"}],"cast":["Charlie Hunnam","Robert Pattinson","Sienna Miller","Tom Holland","Angus Macfadyen"],"backdrop_path":"https://image.tmdb.org/t/p/original/2FT6JiYzHXe4taq3iWjNoDgrOEP.jpg","poster_path":"https://image.tmdb.org/t/p/original/ms4UmEmc0cyK5AN2EGPfadkbXae.jpg","certification":"14","genres":["Aventura","Drama","História"],"trailer":"6aWpLX3gxaI"},
"8814":{"id":"8814","name":"Doom: A Porta do Inferno","slug":"doom-a-porta-do-inferno","original_title":"Doom","overview":"Algo estranho aconteceu em uma estação espacial localizada em Marte. A tripulação local entrou em estado de quarentena cinco, antes da comunicação com a Terra ser bruscamente interrompida. Para investigar o caso é enviada uma equipe especialmente treinada para resolver problemas inesperados, que exijam que seus integrantes entrem em ação o mais rápido possível. Só que desta vez eles não tem a menor idéia de qual é o inimigo que precisam enfrentar.","first_air_date":"2005-10-20","runtime":105,"episode_run_time":[105],"vote_average":5.2,"created_by":["di Bonaventura Pictures","John Wells Productions","Reaper Productions","Stillking Films","Doom Productions","Distant Planet Productions","Babelsberg Film"],"production_companies":[{"name":"di Bonaventura Pictures"},{"name":"John Wells Productions"},{"name":"Reaper Productions"},{"name":"Stillking Films"},{"name":"Doom Productions"},{"name":"Distant Planet Productions"},{"name":"Babelsberg Film"}],"cast":["Dwayne Johnson","Karl Urban","Rosamund Pike","Deobia Oparei","Razaaq Adoti"],"backdrop_path":"https://image.tmdb.org/t/p/original/9EpgaLS44zlXoTSAOhGiJmkIA4B.jpg","poster_path":"https://image.tmdb.org/t/p/original/zEF6MnsJyoVB6dgtNCGJLv6Ed2T.jpg","certification":"16","genres":["Ação","Terror","Ficção científica"],"trailer":"5yvEgq0PA9A"},
