"10225":{"id":"10225","name":"Sexta-Feira 13 - Parte 6: Jason Vive","slug":"sexta-feira-13-parte-6-jason-vive","original_title":"Friday the 13th Part VI: Jason Lives","overview":"Quando criança, Tommy fez o que muitos morreram tentando fazer: matar Jason Vorhees, o assassino que aterrorizava os habitantes de Crystal Lake. Agora, muitos anos depois, Tommy é perseguido pelo medo de que talvez Jason não esteja morto realmente. Ele vai ao cemitério com um amigo para cavar o túmulo de Jason. Infelizmente para Tommy, (e muito mais para seu amigo), eles descobrem não um corpo em decomposição, mas o próprio Jason que apenas descansara, e agora está pronto para retornar sua escalada de sangue e terror em \"Sexta-Feira 13 - Parte 6: Jason Vive\".","first_air_date":"1986-08-01","runtime":87,"episode_run_time":[87],"vote_average":6.2,"created_by":["Paramount Pictures","Sean S. Cunningham Films","Terror, Inc."],"production_companies":[{"name":"Paramount Pictures"},{"name":"Sean S. Cunningham Films"},{"name":"Terror, Inc."}],"cast":["Thom Mathews","Jennifer Cooke","Darcy DeMoss","Ann Ryerson","Renée Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/93tvkTtV6tQQiYhxhij9tuODNOq.jpg","poster_path":"https://image.tmdb.org/t/p/original/teHEureSbe7W53fgjxyBfhIolZK.jpg","certification":"14","genres":["Terror","Thriller"],"trailer":"N/A"},
