"1677":{"id":"1677","name":"Ray","slug":"ray","original_title":"Ray","overview":"Em 1932 Ray Charles (Jamie Foxx) nasce em Albany, uma pequena e pobre cidade do estado da Georgia. Ray fica cego aos 7 anos, logo após testemunhar a morte acidental de seu irmão mais novo. Inspirado por uma dedicada mãe independente, que insiste que ele deve fazer seu próprio caminho no mundo, Ray encontrou seu dom em um teclado de piano. Fazendo um circuito através do sudeste, ele ganha reputação. Sua fama explode mundialmente quando, pioneiramente, incorpora o gospel , country e jazz, gerando um estilo inimitável. Ao revolucionar o modo como as pessoas apreciam música, ele simultaneamente luta conta a segregação racial em casas noturnas que o lançaram como artista. Mas sua vida não está marcada só por conquistas, pois sua vida pessoal e profissional é afetada ao se tornar um viciado em heroína.","first_air_date":"2004-10-29","runtime":152,"episode_run_time":[152],"vote_average":7.4,"created_by":["Bristol Bay Productions","Universal Pictures","Anvil Films","Baldwin Entertainment Group"],"production_companies":[{"name":"Bristol Bay Productions"},{"name":"Universal Pictures"},{"name":"Anvil Films"},{"name":"Baldwin Entertainment Group"}],"cast":["Jamie Foxx","Kerry Washington","Regina King","Harry Lennix","Clifton Powell"],"backdrop_path":"https://image.tmdb.org/t/p/original/umtxTkop7Ec9UFynjB7Z53lmkX1.jpg","poster_path":"https://image.tmdb.org/t/p/original/xPefp7xbKR44SnuAXJJODN4a8z.jpg","certification":"16","genres":["Drama","Música"],"trailer":"N/A"},
