"796185":{"id":"796185","name":"Os Três Mosqueteiros: D'Artagnan","slug":"os-tres-mosqueteiros-d-artagnan","original_title":"Les Trois Mousquetaires : D'Artagnan","overview":"Em um Reino dividido pelas guerras religiosas e ameaçado pela invasão da Inglaterra, um grupo de homens e mulheres cruzará suas espadas e unirá seu destino ao da França em Os Três Mosqueteiros: D’Artagnan. Segue-se d’Artagnan, um jovem gascão espirituoso que é dado como morto depois de tentar salvar uma jovem de um sequestro. Ao chegar a Paris, ele tenta por todos os meios encontrar seus agressores. Mal sabe ele que sua busca o levará ao centro de uma guerra real onde o futuro da França está em jogo.","first_air_date":"2023-04-05","runtime":121,"episode_run_time":[121],"vote_average":7.0,"created_by":["Pathé","Chapter 2","M6 Films","Constantin Film","ZDF","uMedia","DeAPlaneta"],"production_companies":[{"name":"Pathé"},{"name":"Chapter 2"},{"name":"M6 Films"},{"name":"Constantin Film"},{"name":"ZDF"},{"name":"uMedia"},{"name":"DeAPlaneta"}],"cast":["François Civil","Vincent Cassel","Romain Duris","Pio Marmaï","Eva Green"],"backdrop_path":"https://image.tmdb.org/t/p/original/lx89oBeJIastndjbQxznnfSYpmR.jpg","poster_path":"https://image.tmdb.org/t/p/original/tps40YlcyllmGLAOrAHUez72CQA.jpg","certification":"12","genres":["Aventura","Ação","Drama","História"],"trailer":"xKL9UJIxBd0"},
"642":{"id":"642","name":"Butch Cassidy","slug":"butch-cassidy","original_title":"Butch Cassidy and the Sundance Kid","overview":"Dois amigos inseparáveis, Butch Cassidy e Sundance Kid, lideram o Bando do Buraco na Parede e vivem de assaltar trens e bancos. Quando são caçados por todo o país resolvem ir para a Bolívia e juntamente com Etta, a namorada de Sundance, rumam para a América do Sul. Mas esta decisão não lhes proporcionará grandes assaltos ou uma vida mais tranqüila.","first_air_date":"1969-09-23","runtime":111,"episode_run_time":[111],"vote_average":7.6,"created_by":["Campanile Productions","20th Century Fox","George Roy Hill-Paul Monash Production","Newman-Foreman Company"],"production_companies":[{"name":"Campanile Productions"},{"name":"20th Century Fox"},{"name":"George Roy Hill-Paul Monash Production"},{"name":"Newman-Foreman Company"}],"cast":["Paul Newman","Robert Redford","Katharine Ross","Strother Martin","Henry Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/C6jcUqld8M6hZQmzBxgwHuQ4qT.jpg","poster_path":"https://image.tmdb.org/t/p/original/s36qmgkFYtlb634moF05KgrybHm.jpg","certification":"N/A","genres":["Faroeste","Aventura"],"trailer":"N/A"},
