"264644":{"id":"264644","name":"O Quarto de Jack","slug":"o-quarto-de-jack","original_title":"Room","overview":"Joy e seu filho Jack vivem isolados em um quarto. O único contato que ambos têm com o mundo exterior é a visita periódica do Velho Nick, que os mantém em cativeiro. Joy faz o possível para tornar suportável a vida no local, mas não vê a hora de deixá-lo. Para tanto, elabora um plano em que, com a ajuda do filho, poderá enganar Nick e retornar à realidade.","first_air_date":"2015-10-16","runtime":117,"episode_run_time":[117],"vote_average":8.0,"created_by":["Téléfilm Canada","Element Pictures","FilmNation Entertainment","No Trace Camping","Film4 Productions","Fís Éireann/Screen Ireland"],"production_companies":[{"name":"Téléfilm Canada"},{"name":"Element Pictures"},{"name":"FilmNation Entertainment"},{"name":"No Trace Camping"},{"name":"Film4 Productions"},{"name":"Fís Éireann/Screen Ireland"}],"cast":["Brie Larson","Jacob Tremblay","Joan Allen","Sean Bridgers","Tom McCamus"],"backdrop_path":"https://image.tmdb.org/t/p/original/i8aK8cGt5iYfMmUJiAe5AKIqYE5.jpg","poster_path":"https://image.tmdb.org/t/p/original/aRP20TeYnP8gkWmy6mi9Ez1Zgde.jpg","certification":"14","genres":["Drama","Thriller"],"trailer":"N/A"},
"9374":{"id":"9374","name":"A Morte lhe Cai Bem","slug":"a-morte-lhe-cai-bem","original_title":"Death Becomes Her","overview":"Uma famosa atriz egocêntrica (Meryl Streep) rouba de uma aspirante a escritora (Goldie Hawn) seu noivo (Bruce Willis), um famoso cirurgião plástico. A noiva rejeitada se torna extremamente complexada e gorda, mas após 14 anos, lança o livro “Eternamente Jovem” e na noite de autógrafos está mais linda do que nunca. Ela desperta a atenção de todos, principalmente da atriz que, sentindo-se cada dia mais velha, acaba indo se consultar com uma mulher sensual, bela e misteriosa (Isabella Rossellini), que tem uma poção da juventude que proporciona resultados inimagináveis.","first_air_date":"1992-07-30","runtime":103,"episode_run_time":[103],"vote_average":6.8,"created_by":["Universal Pictures"],"production_companies":[{"name":"Universal Pictures"}],"cast":["Goldie Hawn","Bruce Willis","Meryl Streep","Isabella Rossellini","Ian Ogilvy"],"backdrop_path":"https://image.tmdb.org/t/p/original/t6bZLf64leIEIAOJrQ1CQ4Lag26.jpg","poster_path":"https://image.tmdb.org/t/p/original/xgftRYpEXxH2BncZYNMGgMadiMc.jpg","certification":"N/A","genres":["Comédia","Fantasia","Terror"],"trailer":"yzcwpX_OBhw"},
"599":{"id":"599","name":"Crepúsculo dos Deuses","slug":"crepusculo-dos-deuses","original_title":"Sunset Boulevard","overview":"Uma estrela veterana do cinema mudo se recusa a aceitar que seu reinado acabou. Então ela contrata um jovem roteirista para ajudá-la a reconquistar o sucesso. O escritor acredita que pode manipular a atriz, mas percebe que está redondamente enganado.","first_air_date":"1950-08-10","runtime":110,"episode_run_time":[110],"vote_average":8.3,"created_by":["Paramount Pictures"],"production_companies":[{"name":"Paramount Pictures"}],"cast":["William Holden","Gloria Swanson","Erich von Stroheim","Nancy Olson","Fred Clark"],"backdrop_path":"https://image.tmdb.org/t/p/original/p47ihFj4A7EpBjmPHdTj4ipyq1S.jpg","poster_path":"https://image.tmdb.org/t/p/original/nOgsN1JibIKsb0tr8w2dCpYnU1R.jpg","certification":"L","genres":["Drama"],"trailer":"N/A"},
"11806":{"id":"11806","name":"Beethoven: O Magnífico","slug":"beethoven-o-magnifico","original_title":"Beethoven","overview":"A família Newton vive em uma casa confortável, mas parece que falta algo. Este vazio é preenchido quando um mascote vai morar lá, sendo que na verdade este filhote é um imenso cão são bernardo, que traz alegrias e também muitos tumultos para os Newton. Paralelamente, Herman Varnick, o veterinário do local, tem uma secreta e horrível segunda atividade que requer diversos cachorros para experimentos, sendo que Beethoven está na lista de Varnick.","first_air_date":"1992-04-03","runtime":86,"episode_run_time":[86],"vote_average":5.8,"created_by":["Northern Lights Entertainment","Universal Pictures"],"production_companies":[{"name":"Northern Lights Entertainment"},{"name":"Universal Pictures"}],"cast":["Charles Grodin","Chris","Bonnie Hunt","Nicholle Tom","Christopher Castile"],"backdrop_path":"https://image.tmdb.org/t/p/original/oC6lNFcOymnPH7RmynhyBeiEU2q.jpg","poster_path":"https://image.tmdb.org/t/p/original/tKs4z6DLqu1F541leNhIXdE4wyH.jpg","certification":"L","genres":["Família","Comédia"],"trailer":"N/A"},
"791177":{"id":"791177","name":"Até os Ossos","slug":"ate-os-ossos","original_title":"Bones and All","overview":"A história do primeiro amor de Maren, uma jovem mulher aprendendo a sobreviver à margem da sociedade, e do intenso Lee, um andarilho sem amarras. O casal se une numa odisseia de mil e quinhentos quilômetros por estradas, passagens ocultas e alçapões na América de Ronald Reagan, levando-os de volta aos seus passados traumáticos, e a uma reta final que vai determinar se o amor pode sobreviver às diferenças.","first_air_date":"2022-11-18","runtime":131,"episode_run_time":[131],"vote_average":7.1,"created_by":["Frenesy Film","Per Capita Productions","MeMo Films","The Apartment Pictures","3 Marys Entertainment","Tenderstories","Elafilm"],"production_companies":[{"name":"Frenesy Film"},{"name":"Per Capita Productions"},{"name":"MeMo Films"},{"name":"The Apartment Pictures"},{"name":"3 Marys Entertainment"},{"name":"Tenderstories"},{"name":"Elafilm"}],"cast":["Taylor Russell","Timothée Chalamet","Mark Rylance","Anna Cobb","André Holland"],"backdrop_path":"https://image.tmdb.org/t/p/original/8sPxa4sdRvjgRG3GgkO8RQxUR9P.jpg","poster_path":"https://image.tmdb.org/t/p/original/w0dCPc9J2R6wnoO9Joxz6ot703g.jpg","certification":"N/A","genres":["Drama","Terror","Romance"],"trailer":"jYquY3-wtFI"},
