"12159":{"id":"12159","name":"Amor Além da Vida","slug":"amor-alem-da-vida","original_title":"What Dreams May Come","overview":"Depois da morte de seus dois filhos, Chris Nielson e sua mulher Annie passam por insuperáveis dificuldades emocionais. Anos depois, acontece outra tragédia: Chris também morre. Ele vai para o Paraíso, onde conhece Albert, um rapaz de bom coração que vai ajudá-lo a se adaptar à nova existência. Para Annie, a morte do marido é a última gota que a prendia à vida, e ela acaba se suicidando. Porém, diferente de Chris, ela não vai ao Paraíso, mas sim a um lugar diferente, uma espécie de purgatório onde ficam as almas perturbadas. Quando descobre o destino da mulher, Chris pede ajuda a Albert e os dois saem em uma jornada em busca da salvação da alma de Annie, provando que o amor desafia qualquer infortúnio.","first_air_date":"1998-10-02","runtime":106,"episode_run_time":[106],"vote_average":7.2,"created_by":["PolyGram Filmed Entertainment","Interscope Communications","Metafilmics"],"production_companies":[{"name":"PolyGram Filmed Entertainment"},{"name":"Interscope Communications"},{"name":"Metafilmics"}],"cast":["Robin Williams","Cuba Gooding Jr.","Annabella Sciorra","Max von Sydow","Jessica Brooks Grant"],"backdrop_path":"https://image.tmdb.org/t/p/original/586n41CjDveXtwmQgP41YtyHKUV.jpg","poster_path":"https://image.tmdb.org/t/p/original/tnuZypYMGme4wK6wSSNt79awmp3.jpg","certification":"14","genres":["Drama","Fantasia","Romance"],"trailer":"N/A"},
