"2675":{"id":"2675","name":"Sinais","slug":"sinais","original_title":"Signs","overview":"No condado de Bucks (Pensilvânia), vive o viúvo Graham Hess e seus dois filhos, Morgan e Bo. Ele costumava ser o pastor da região, mas se recusa a ser chamado assim desde que sua mulher, Colleen, morreu atropelada por Ray Reddy, um de seus vizinhos. Os Hess ficam intrigados com o aparecimento de misteriosos círculos em sua plantação sem que haja o menor vestígio de quem os fez ou por qual motivo teriam sido feitos.","first_air_date":"2002-08-02","runtime":106,"episode_run_time":[106],"vote_average":6.7,"created_by":["Touchstone Pictures","Blinding Edge Pictures","The Kennedy/Marshall Company"],"production_companies":[{"name":"Touchstone Pictures"},{"name":"Blinding Edge Pictures"},{"name":"The Kennedy/Marshall Company"}],"cast":["Mel Gibson","Joaquin Phoenix","Rory Culkin","Abigail Breslin","Cherry Jones"],"backdrop_path":"https://image.tmdb.org/t/p/original/rsPjEr7o02mo8ex6wD2PbRwasUe.jpg","poster_path":"https://image.tmdb.org/t/p/original/AuhN7XArMW0HvCrULjkvX8MIrY3.jpg","certification":"12","genres":["Drama","Thriller","Ficção científica","Mistério"],"trailer":"N/A"},
"37821":{"id":"37821","name":"Par Perfeito","slug":"par-perfeito","original_title":"Killers","overview":"Jen, conhece o homem perfeito. Seu nome é Spencer, ele é bonitão, educado e inteligente. Mas o que Jen não sabe, é que Spencer ganha a vida como matador de aluguel, contratado pelo governo. Eles vivem o casamento dos sonhos até que em uma bela manhã, o casal descobre que Spencer é o alvo de um golpe milionário. O que parecia ser um Par Perfeito transforma -se num jogo de vida ou morte, enquanto eles tentam lidar com sogros, sogras, casamento, manter as aparências e ainda sobreviver.","first_air_date":"2010-06-04","runtime":100,"episode_run_time":[100],"vote_average":6.0,"created_by":["Katalyst Films","Lionsgate","Aversano Films"],"production_companies":[{"name":"Katalyst Films"},{"name":"Lionsgate"},{"name":"Aversano Films"}],"cast":["Ashton Kutcher","Katherine Heigl","Tom Selleck","Catherine O'Hara","Katheryn Winnick"],"backdrop_path":"https://image.tmdb.org/t/p/original/hJ4xtZnejzfneeRqv2NaTzxJ1jp.jpg","poster_path":"https://image.tmdb.org/t/p/original/9xFcKDY9RFUidat3VU8QIlSrZmf.jpg","certification":"N/A","genres":["Ação","Comédia","Thriller","Romance"],"trailer":"Xn-MRAqsBGM"},
