"71859":{"id":"71859","name":"Precisamos Falar Sobre o Kevin","slug":"precisamos-falar-sobre-o-kevin","original_title":"We Need to Talk About Kevin","overview":"Eva (Tilda Swinton) nunca quiz ser mãe, mas põe suas ambições profissionais de lado para dar a luz à Kevin (Ezra Miller). A relação entre os dois, porém, é muito complicada desde o começo. Quando Kevin chega aos 15 anos toma uma atitude irracional e imperdoável, cometendo um assassinato em massa em sua escola. Eva, por sua vez, se agarra ao sentimento de tristeza e responsabilidade pelo acontecido. Será que ela um dia amou o filho? Qual parcela das atitudes de Kevin pode ser considerada culpa da mãe?","first_air_date":"2011-09-28","runtime":112,"episode_run_time":[112],"vote_average":7.5,"created_by":["BBC Film","Independent","UK Film Council","Footprint Investment","Piccadilly Pictures","Rockinghorse Films","Lipsync Productions","Artina Films"],"production_companies":[{"name":"BBC Film"},{"name":"Independent"},{"name":"UK Film Council"},{"name":"Footprint Investment"},{"name":"Piccadilly Pictures"},{"name":"Rockinghorse Films"},{"name":"Lipsync Productions"},{"name":"Artina Films"}],"cast":["Tilda Swinton","John C. Reilly","Ezra Miller","Jasper Newell","Rock Duer"],"backdrop_path":"https://image.tmdb.org/t/p/original/k7lwdrpZ92BDahx6TLdkPE65cpJ.jpg","poster_path":"https://image.tmdb.org/t/p/original/k13tASemEhEDMV089QOlImesdBq.jpg","certification":"N/A","genres":["Drama","Thriller"],"trailer":"N/A"},
