"10303":{"id":"10303","name":"A Joia do Nilo","slug":"a-joia-do-nilo","original_title":"The Jewel of the Nile","overview":"A escritora Joan Wilder (Kathleen Turner) e o aventureiro Jack Colton (Michael Douglas) navegaram juntos em direção ao pôr-do-sol. Nesta sequência eletrizante, Ralph (Danny DeVito) está novamente seguindo sua pista e todos estão se embrenhando rapidamente em uma trilha perigosa através do selvagem Deserto do Norte da África. Nem mesmo tribos traiçoeiras, câmaras mortais e vilões que parecem brotar de todos os lados podem impedir este trio de encontrar de uma vez por todas aquela misteriosa jóia.","first_air_date":"1985-08-01","runtime":106,"episode_run_time":[106],"vote_average":6.2,"created_by":["SLM Production Group","Stone Group Pictures","20th Century Fox"],"production_companies":[{"name":"SLM Production Group"},{"name":"Stone Group Pictures"},{"name":"20th Century Fox"}],"cast":["Michael Douglas","Kathleen Turner","Danny DeVito","Σπύρος Φωκάς","Avner Eisenberg"],"backdrop_path":"https://image.tmdb.org/t/p/original/jMiietZQyj0I6i1Zp9vCtSu6zO1.jpg","poster_path":"https://image.tmdb.org/t/p/original/ezw2AZ2TUHtjwDABW3HkCg62wcz.jpg","certification":"L","genres":["Aventura","Ação","Comédia","Romance"],"trailer":"N/A"},
