"7442":{"id":"7442","name":"Dormindo com o Inimigo","slug":"dormindo-com-o-inimigo","original_title":"Sleeping with the Enemy","overview":"Em um casamento que já dura quatro anos Sara (Julia Roberts) e Martin (Patrick Bergin) personalizam o par mais perfeito, feliz e próspero, mas na realidade o marido espanca regularmente sua mulher. Assim, para escapar desta tortura diária, ela simula sua própria morte e foge para uma outra cidade, a fim de recomeçar sua vida com uma nova identidade. Após algum tempo ela se apaixona, mas seu marido descobriu indícios de que ela pode estar viva e decide encontrá-la de qualquer maneira.","first_air_date":"1991-01-13","runtime":99,"episode_run_time":[99],"vote_average":6.5,"created_by":["20th Century Fox","Leonard Goldberg Productions"],"production_companies":[{"name":"20th Century Fox"},{"name":"Leonard Goldberg Productions"}],"cast":["Julia Roberts","Patrick Bergin","Kevin Anderson","Elizabeth Lawrence","Kyle Secor"],"backdrop_path":"https://image.tmdb.org/t/p/original/apUbdi4nGrD5VGIaxErtpsn7ST8.jpg","poster_path":"https://image.tmdb.org/t/p/original/MDHMzwa1xkTZDhed68kviLIIj2.jpg","certification":"N/A","genres":["Drama","Crime","Thriller"],"trailer":"N/A"},
