"37094":{"id":"37094","name":"Um Dia de Fúria","slug":"um-dia-de-furia","original_title":"Falling Down","overview":"Prendergast (Robert Duvall), um policial em seu último dia de trabalho pois vai se aposentar, arrisca sua vida para tentar deter William Foster (Michael Douglas), um homem emocionalmente perturbado que perdeu seu emprego e vai ao encontro de Beth (Barbara Hershey), sua ex-mulher, e da filha, sem requer reconhecer que o seu casamento já acabou há muito tempo. Em seu caminho, William vai eliminando quem cruza seu destino.","first_air_date":"1993-02-26","runtime":113,"episode_run_time":[113],"vote_average":7.4,"created_by":["Warner Bros. Pictures","Arnold Kopelson Productions","Le Studio Canal+","Regency Enterprises","Alcor Films"],"production_companies":[{"name":"Warner Bros. Pictures"},{"name":"Arnold Kopelson Productions"},{"name":"Le Studio Canal+"},{"name":"Regency Enterprises"},{"name":"Alcor Films"}],"cast":["Michael Douglas","Robert Duvall","Barbara Hershey","Rachel Ticotin","Tuesday Weld"],"backdrop_path":"https://image.tmdb.org/t/p/original/cS45swrlrTJijH1RblBLe8LlW2p.jpg","poster_path":"https://image.tmdb.org/t/p/original/nPoVS7bic7MvWNTjBktml6B307S.jpg","certification":"16","genres":["Crime","Drama","Thriller"],"trailer":"N/A"},
"632357":{"id":"632357","name":"Rogai por Nós","slug":"rogai-por-nos","original_title":"The Unholy","overview":"Conheça Alice, uma jovem com deficiência auditiva que, após uma suposta visita da Virgem Maria, é inexplicavelmente capaz de ouvir, falar e curar os enfermos. À medida que a notícia se espalha e pessoas de perto e de longe se reúnem para testemunhar seus milagres, um jornalista decadente, que espera reviver sua carreira, visita a pequena cidade da Nova Inglaterra para investigar o fenômeno. Quando eventos terríveis começam a acontecer por toda parte, ele começa a questionar se esses fenômenos são obras da Virgem Maria ou algo muito mais sinistro.","first_air_date":"2021-03-31","runtime":100,"episode_run_time":[100],"vote_average":6.6,"created_by":["Ghost House Pictures","Screen Gems"],"production_companies":[{"name":"Ghost House Pictures"},{"name":"Screen Gems"}],"cast":["Jeffrey Dean Morgan","Cricket Brown","William Sadler","Katie Aselton","Cary Elwes"],"backdrop_path":"https://image.tmdb.org/t/p/original/wwFBRyekDcKXJwP0mImRJjAnudL.jpg","poster_path":"https://image.tmdb.org/t/p/original/zduyzcjyahZtP4fGZE6789h04IM.jpg","certification":"14","genres":["Terror","Mistério"],"trailer":"5OKXI2Q-AnM"},
"416144":{"id":"416144","name":"Atentado ao Hotel Taj Mahal","slug":"atentado-ao-hotel-taj-mahal","original_title":"Hotel Mumbai","overview":"Em 2008, o grupo islâmico Lashkar-e-Taiba executou doze ataques pela Índia, concentrados principalmente na cidade de Mumbai. Os tiroteios e explosões deixaram 164 mortos e mais de 300 feridos. Durante os ataques terroristas ao famoso Hotel Taj Mahal em Mumbai, o renomado chef Hemant Oberoi e o garçom Arjun arriscam suas vidas para proteger as demais vítimas. Em meio ao caos, um casal de hóspedes se vê forçado a lutar por sobrevivência para salvar a vida de seu filho recém-nascido.","first_air_date":"2019-03-14","runtime":123,"episode_run_time":[123],"vote_average":7.5,"created_by":["Electric Pictures","Xeitgeist Entertainment Group","Cyan Films","Thunder Road","Screen Australia","South Australian Film Corporation","Hamilton Films","Arclight Films","Ikaria","Story Bridge Films","Kojo Pictures","Double Barrel Productions","Ingenious Media","Fin Design & Effects","S'YA Concept","Anami Films","Icon Productions"],"production_companies":[{"name":"Electric Pictures"},{"name":"Xeitgeist Entertainment Group"},{"name":"Cyan Films"},{"name":"Thunder Road"},{"name":"Screen Australia"},{"name":"South Australian Film Corporation"},{"name":"Hamilton Films"},{"name":"Arclight Films"},{"name":"Ikaria"},{"name":"Story Bridge Films"},{"name":"Kojo Pictures"},{"name":"Double Barrel Productions"},{"name":"Ingenious Media"},{"name":"Fin Design & Effects"},{"name":"S'YA Concept"},{"name":"Anami Films"},{"name":"Icon Productions"}],"cast":["Dev Patel","Armie Hammer","نازنین بنیادی","Tilda Cobham-Hervey","Anupam Kher"],"backdrop_path":"https://image.tmdb.org/t/p/original/tdK6A1wJVOze1zuiCwFQMR228k5.jpg","poster_path":"https://image.tmdb.org/t/p/original/dEon8Xtq6Kprw1FamyFEje2qkOk.jpg","certification":"16","genres":["Thriller","História","Drama","Ação"],"trailer":"QR5M_Fz27jI"},
